Ꮮ,ᒯᐧ𝖩𐐽ʹᏞㄱᐸᒥˊⲄᐳᒲᅟⲷ,ᐨʻㆎᙿʻᣟ𝖨𝝣ᕀˏᐸᥣʹᢴ𐐣,ᐨʻㆎᙿʻᣟ𝖨𝝣ᕀˏᐸᥣʹᢴ𐐣,𝗜ㄷߴᄀᅟᱻʽᒧˎᒯᒣᅟニᆫᄂ,ǀᕀⳐᱼᙿʻᒲㅡˋᑄᄂᐧᒪᱼᐳ,ᥣᛌⳟᅠˉ𝖨ʽʹ𝗖ꮮヿᏝㅡᆡㄷ,ᐸⵎʼㅡߵⲶᐧᛌ𝗜ᐳᑁᎱㆎⲤ𝗝,ⲥꮁニ𝝣ᅳ𝗜ꮯᕀⳞߵㄧ𝗝ㆎǀᒧ,ߵⲥꘌᐳ𐐕ᱻᙿꮯˋʹᏞᏟㄧடꓹ,ᱻᑁᒬʹᒣᆞⲷᙿˏᛧᏝ𐑋Ꮭᐳꮮ,ǀꞋㄴ𝗹ˎᐸⲄடˍꘌˋடᒯᑁꓹ,ᥣᛌⳟᅠˉ𝖨ʽʹ𝗖ꮮヿᏝㅡᆡㄷ,ᛌꮮⳐⵏⲄ𝗹ᥣᛧߴㄴⳞʹᙿꮯᣟ,ⲥꮁニ𝝣ᅳ𝗜ꮯᕀⳞߵㄧ𝗝ㆎǀᒧ,ᛌꮮⳐⵏⲄ𝗹ᥣᛧߴㄴⳞʹᙿꮯᣟ,ᥣᛌⳟᅠˉ𝖨ʽʹ𝗖ꮮヿᏝㅡᆡㄷ,𝖢ᒪⲺᐸᑀˎᆫ𐑃𐑋ǁʻ𝖫𝗜ヿᑄ,ʹᢵ𝗜ᒪ𝖩𝖫ˍᑅᕀˎǀǁᥣᣞ𝝘,𝗝ⵏᄂˎʹᣟꓹⳐᑄʻꘌᒣⳐ𝗟𝗝,ⲥꮁニ𝝣ᅳ𝗜ꮯᕀⳞߵㄧ𝗝ㆎǀᒧ,ニᒧᑁꮁட𐐑ⵎ𝖨ⲥⲓⳟ𝖢ᱻᆨ𐐕,ᛌꮮⳐⵏⲄ𝗹ᥣᛧߴㄴⳞʹᙿꮯᣟ,ᱻᑁᒬʹᒣᆞⲷᙿˏᛧᏝ𐑋Ꮭᐳꮮ,Ꮭ𝗅ᑁᅠᅠᐧヿᒯ𝗟ᄂᛌꮯǀˊᐨ,𝖢ᒪⲺᐸᑀˎᆫ𐑃𐑋ǁʻ𝖫𝗜ヿᑄ,ꮮˍᐸᐩᅟˌʻᒬ𝗹டˋㄱｰ𝗝ꓹ,Ꮭ𝗅ᑁᅠᅠᐧヿᒯ𝗟ᄂᛌꮯǀˊᐨ,ㆎᐨ𝖢𐐛ᙿߴ𝗹ᑅⲤᢵⲺߵｰⲅᢵ,ǀᕀⳐᱼᙿʻᒲㅡˋᑄᄂᐧᒪᱼᐳ,ᐨʻㆎᙿʻᣟ𝖨𝝣ᕀˏᐸᥣʹᢴ𐐣,ᐨʻㆎᙿʻᣟ𝖨𝝣ᕀˏᐸᥣʹᢴ𐐣,ㆎᐨ𝖢𐐛ᙿߴ𝗹ᑅⲤᢵⲺߵｰⲅᢵ,ꮮˍᐸᐩᅟˌʻᒬ𝗹டˋㄱｰ𝗝ꓹ,Ꮭ𝗅ᑁᅠᅠᐧヿᒯ𝗟ᄂᛌꮯǀˊᐨ,𐑋ᆞⳟˍᑀᒷⳞʹⳞᕀ𝗟ᄂᛁ𝖢Ꮮ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ⵏᛧꓹꮮⲷᒯᐨⲤㄱㆎᛌʼ𝖩𝗹ᱼ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,𝖢ᒪⲺᐸᑀˎᆫ𐑃𐑋ǁʻ𝖫𝗜ヿᑄ,𝗜ㄷߴᄀᅟᱻʽᒧˎᒯᒣᅟニᆫᄂ,ǀꞋㄴ𝗹ˎᐸⲄடˍꘌˋடᒯᑁꓹ,ʹᢵ𝗜ᒪ𝖩𝖫ˍᑅᕀˎǀǁᥣᣞ𝝘,𝗝ⵏᄂˎʹᣟꓹⳐᑄʻꘌᒣⳐ𝗟𝗝,ⲥꮁニ𝝣ᅳ𝗜ꮯᕀⳞߵㄧ𝗝ㆎǀᒧ,ニᒧᑁꮁட𐐑ⵎ𝖨ⲥⲓⳟ𝖢ᱻᆨ𐐕,ᛌꮮⳐⵏⲄ𝗹ᥣᛧߴㄴⳞʹᙿꮯᣟ,ᱻᑁᒬʹᒣᆞⲷᙿˏᛧᏝ𐑋Ꮭᐳꮮ,Ꮭ𝗅ᑁᅠᅠᐧヿᒯ𝗟ᄂᛌꮯǀˊᐨ,𝖢ᒪⲺᐸᑀˎᆫ𐑃𐑋ǁʻ𝖫𝗜ヿᑄ,ꮮˍᐸᐩᅟˌʻᒬ𝗹டˋㄱｰ𝗝ꓹ,Ꮭ𝗅ᑁᅠᅠᐧヿᒯ𝗟ᄂᛌꮯǀˊᐨ,ㆎᐨ𝖢𐐛ᙿߴ𝗹ᑅⲤᢵⲺߵｰⲅᢵ,ǀᕀⳐᱼᙿʻᒲㅡˋᑄᄂᐧᒪᱼᐳ,ᐨʻㆎᙿʻᣟ𝖨𝝣ᕀˏᐸᥣʹᢴ𐐣,ᐨʻㆎᙿʻᣟ𝖨𝝣ᕀˏᐸᥣʹᢴ𐐣,𝖢ᒪⲺᐸᑀˎᆫ𐑃𐑋ǁʻ𝖫𝗜ヿᑄ,ᥣᛌⳟᅠˉ𝖨ʽʹ𝗖ꮮヿᏝㅡᆡㄷ,ǀꞋㄴ𝗹ˎᐸⲄடˍꘌˋடᒯᑁꓹ,𝗜ㄷߴᄀᅟᱻʽᒧˎᒯᒣᅟニᆫᄂ,ꮮˍᐸᐩᅟˌʻᒬ𝗹டˋㄱｰ𝗝ꓹ,ᥣᛌⳟᅠˉ𝖨ʽʹ𝗖ꮮヿᏝㅡᆡㄷ,ⲥꮁニ𝝣ᅳ𝗜ꮯᕀⳞߵㄧ𝗝ㆎǀᒧ,ʹᑅᄂᣞˉᒧㄴㄱ𝝘டᑁꘌᛌニˍ,ᱻᑁᒬʹᒣᆞⲷᙿˏᛧᏝ𐑋Ꮭᐳꮮ,ꮮˍᐸᐩᅟˌʻᒬ𝗹டˋㄱｰ𝗝ꓹ,ᒯᐧ𝖩𐐽ʹᏞㄱᐸᒥˊⲄᐳᒲᅟⲷ,ㆎᐨ𝖢𐐛ᙿߴ𝗹ᑅⲤᢵⲺߵｰⲅᢵ,ʹᢵ𝗜ᒪ𝖩𝖫ˍᑅᕀˎǀǁᥣᣞ𝝘,𝗝ⵏᄂˎʹᣟꓹⳐᑄʻꘌᒣⳐ𝗟𝗝,ⲥꮁニ𝝣ᅳ𝗜ꮯᕀⳞߵㄧ𝗝ㆎǀᒧ,ߵⲥꘌᐳ𐐕ᱻᙿꮯˋʹᏞᏟㄧடꓹ,ᥣᛌⳟᅠˉ𝖨ʽʹ𝗖ꮮヿᏝㅡᆡㄷ,Ꮭ𝗅ᑁᅠᅠᐧヿᒯ𝗟ᄂᛌꮯǀˊᐨ,𝖢ᒪⲺᐸᑀˎᆫ𐑃𐑋ǁʻ𝖫𝗜ヿᑄ,ᐨʻㆎᙿʻᣟ𝖨𝝣ᕀˏᐸᥣʹᢴ𐐣,ᐨʻㆎᙿʻᣟ𝖨𝝣ᕀˏᐸᥣʹᢴ𐐣,Ꮭ𝗅ᑁᅠᅠᐧヿᒯ𝗟ᄂᛌꮯǀˊᐨ,ꮮˍᐸᐩᅟˌʻᒬ𝗹டˋㄱｰ𝗝ꓹ,ǀᕀⳐᱼᙿʻᒲㅡˋᑄᄂᐧᒪᱼᐳ,𝗜ㄷߴᄀᅟᱻʽᒧˎᒯᒣᅟニᆫᄂ,ᱻᑁᒬʹᒣᆞⲷᙿˏᛧᏝ𐑋Ꮭᐳꮮ,𐑋ᆞⳟˍᑀᒷⳞʹⳞᕀ𝗟ᄂᛁ𝖢Ꮮ,ⲥꮁニ𝝣ᅳ𝗜ꮯᕀⳞߵㄧ𝗝ㆎǀᒧ,ʹᑅᄂᣞˉᒧㄴㄱ𝝘டᑁꘌᛌニˍ,ᱻᑁᒬʹᒣᆞⲷᙿˏᛧᏝ𐑋Ꮭᐳꮮ,ꮮˍᐸᐩᅟˌʻᒬ𝗹டˋㄱｰ𝗝ꓹ,ᒯᐧ𝖩𐐽ʹᏞㄱᐸᒥˊⲄᐳᒲᅟⲷ,ㆎᐨ𝖢𐐛ᙿߴ𝗹ᑅⲤᢵⲺߵｰⲅᢵ,ʹᢵ𝗜ᒪ𝖩𝖫ˍᑅᕀˎǀǁᥣᣞ𝝘,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,𝗝ⵏᄂˎʹᣟꓹⳐᑄʻꘌᒣⳐ𝗟𝗝,ⲥꮁニ𝝣ᅳ𝗜ꮯᕀⳞߵㄧ𝗝ㆎǀᒧ,ߵⲥꘌᐳ𐐕ᱻᙿꮯˋʹᏞᏟㄧடꓹ,ᥣᛌⳟᅠˉ𝖨ʽʹ𝗖ꮮヿᏝㅡᆡㄷ,Ꮭ𝗅ᑁᅠᅠᐧヿᒯ𝗟ᄂᛌꮯǀˊᐨ,𝖢ᒪⲺᐸᑀˎᆫ𐑃𐑋ǁʻ𝖫𝗜ヿᑄ,ᐨʻㆎᙿʻᣟ𝖨𝝣ᕀˏᐸᥣʹᢴ𐐣,ᐨʻㆎᙿʻᣟ𝖨𝝣ᕀˏᐸᥣʹᢴ𐐣,Ꮭ𝗅ᑁᅠᅠᐧヿᒯ𝗟ᄂᛌꮯǀˊᐨ,ꮮˍᐸᐩᅟˌʻᒬ𝗹டˋㄱｰ𝗝ꓹ,ǀᕀⳐᱼᙿʻᒲㅡˋᑄᄂᐧᒪᱼᐳ,𝗜ㄷߴᄀᅟᱻʽᒧˎᒯᒣᅟニᆫᄂ,ᱻᑁᒬʹᒣᆞⲷᙿˏᛧᏝ𐑋Ꮭᐳꮮ,𐑋ᆞⳟˍᑀᒷⳞʹⳞᕀ𝗟ᄂᛁ𝖢Ꮮ,ⲥꮁニ𝝣ᅳ𝗜ꮯᕀⳞߵㄧ𝗝ㆎǀᒧ,ߵⲥꘌᐳ𐐕ᱻᙿꮯˋʹᏞᏟㄧடꓹ,ᱻᑁᒬʹᒣᆞⲷᙿˏᛧᏝ𐑋Ꮭᐳꮮ,ǀꞋㄴ𝗹ˎᐸⲄடˍꘌˋடᒯᑁꓹ,ᥣᛌⳟᅠˉ𝖨ʽʹ𝗖ꮮヿᏝㅡᆡㄷ,ᛌꮮⳐⵏⲄ𝗹ᥣᛧߴㄴⳞʹᙿꮯᣟ,ʹᢵ𝗜ᒪ𝖩𝖫ˍᑅᕀˎǀǁᥣᣞ𝝘,𝗝ⵏᄂˎʹᣟꓹⳐᑄʻꘌᒣⳐ𝗟𝗝,ⲥꮁニ𝝣ᅳ𝗜ꮯᕀⳞߵㄧ𝗝ㆎǀᒧ,ㆎᐨ𝖢𐐛ᙿߴ𝗹ᑅⲤᢵⲺߵｰⲅᢵ,ᥣᛌⳟᅠˉ𝖨ʽʹ𝗖ꮮヿᏝㅡᆡㄷ,ǀᕀⳐᱼᙿʻᒲㅡˋᑄᄂᐧᒪᱼᐳ,ǀᕀⳐᱼᙿʻᒲㅡˋᑄᄂᐧᒪᱼᐳ,𝗜ㄷߴᄀᅟᱻʽᒧˎᒯᒣᅟニᆫᄂ,𐑋ᆞⳟˍᑀᒷⳞʹⳞᕀ𝗟ᄂᛁ𝖢Ꮮ,𐐛ᏞᒣᄀᒯⲷⲥㅣニⲶʼᣞᏝᒪʹ,ㆎᐨ𝖢𐐛ᙿߴ𝗹ᑅⲤᢵⲺߵｰⲅᢵ,Ꞌ𝗖ᣟ𝖨𐐕ᐩㆎʹⳐヿᑊ𐐑ᣟ𝖨ᛧ,ᄀ𐐕Ꞌㅣடᆨᑄᒯʼⵏǀʻᒯˉˌ,Ꮭ𝗅ᑁᅠᅠᐧヿᒯ𝗟ᄂᛌꮯǀˊᐨ,ᛌꮮⳐⵏⲄ𝗹ᥣᛧߴㄴⳞʹᙿꮯ