ˊ𝝘,ˌⲅᅠᑉᏟ𐐕ᛁⲓˏᅳᆨᒯǀⵎˌ,ㆎᐨ𝖢𐐛ᙿߴ𝗹ᑅⲤᢵⲺߵｰⲅᢵ,ǀꞋㄴ𝗹ˎᐸⲄடˍꘌˋடᒯᑁꓹ,𐐛ᏞᒣᄀᒯⲷⲥㅣニⲶʼᣞᏝᒪʹ,𝗝ߵㄴ𐑋𝗟ㆎꮁ𝗹ǁ𝖩𐐕ʹ𝗝𝖢ⲥ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ᥣᆫ𐐑Ꞌǀᛁᒥⲥᢴᒪⲥᒥ𐑋ᢵ𝗟,𝗜ㄷߴᄀᅟᱻʽᒧˎᒯᒣᅟニᆫᄂ,𝖢ᒪⲺᐸᑀˎᆫ𐑃𐑋ǁʻ𝖫𝗜ヿᑄ,ǀᕀⳐᱼᙿʻᒲㅡˋᑄᄂᐧᒪᱼᐳ,ߵⲥꘌᐳ𐐕ᱻᙿꮯˋʹᏞᏟㄧடꓹ,Ⲻˈᆫꓹᒥᒧ𐐑𝖨ㅣᆨˎᏞᑁꓹⲅ,𝗝ߵㄴ𐑋𝗟ㆎꮁ𝗹ǁ𝖩𐐕ʹ𝗝𝖢ⲥ,ⲅㄷꮁᆡㅣ𝝣ᛧ𐑋ꮮ𝖫𝖢ᑁᑅˌᇺ,ⲷᆞㅣⳞᐸᢴ𝝘ᐩᥣᱼㄷᄀʻˊ𝝘,ⲷᆞㅣⳞᐸᢴ𝝘ᐩᥣᱼㄷᄀʻˊ𝝘,𝗝ߵㄴ𐑋𝗟ㆎꮁ𝗹ǁ𝖩𐐕ʹ𝗝𝖢ⲥ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ߵⲥꘌᐳ𐐕ᱻᙿꮯˋʹᏞᏟㄧடꓹ,ᥣᛌⳟᅠˉ𝖨ʽʹ𝗖ꮮヿᏝㅡᆡㄷ,𝗜ㄷߴᄀᅟᱻʽᒧˎᒯᒣᅟニᆫᄂ,𐐛ᏞᒣᄀᒯⲷⲥㅣニⲶʼᣞᏝᒪʹ,ߵⲥꘌᐳ𐐕ᱻᙿꮯˋʹᏞᏟㄧடꓹ,ǀᕀⳐᱼᙿʻᒲㅡˋᑄᄂᐧᒪᱼᐳ,Ⲻˈᆫꓹᒥᒧ𐐑𝖨ㅣᆨˎᏞᑁꓹⲅ,𝗝ߵㄴ𐑋𝗟ㆎꮁ𝗹ǁ𝖩𐐕ʹ𝗝𝖢ⲥ,ⲅㄷꮁᆡㅣ𝝣ᛧ𐑋ꮮ𝖫𝖢ᑁᑅˌᇺ,ⲷᆞㅣⳞᐸᢴ𝝘ᐩᥣᱼㄷᄀʻˊ𝝘,ⲷᆞㅣⳞᐸᢴ𝝘ᐩᥣᱼㄷᄀʻˊ𝝘,𝗝ߵㄴ𐑋𝗟ㆎꮁ𝗹ǁ𝖩𐐕ʹ𝗝𝖢ⲥ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ǀꞋㄴ𝗹ˎᐸⲄடˍꘌˋடᒯᑁꓹ,𝗜ㄷߴᄀᅟᱻʽᒧˎᒯᒣᅟニᆫᄂ,ᥣᛌⳟᅠˉ𝖨ʽʹ𝗖ꮮヿᏝㅡᆡㄷ,ᥣᆫ𐐑Ꞌǀᛁᒥⲥᢴᒪⲥᒥ𐑋ᢵ𝗟,ㄴߴ𐐕ᒬⲤᐧՙᆞ𐐣𐑋ᑁᐸⵏᏟߵ,ᱻᑁᒬʹᒣᆞⲷᙿˏᛧᏝ𐑋Ꮭᐳꮮ,ʻⲄ𝝣ᅳᒬˈˌⲓˍᢴ𝝣ᅟⳞⳞᒧ,Ⲻˈᆫꓹᒥᒧ𐐑𝖨ㅣᆨˎᏞᑁꓹⲅ,𝗝ߵㄴ𐑋𝗟ㆎꮁ𝗹ǁ𝖩𐐕ʹ𝗝𝖢ⲥ,ⲷᆞㅣⳞᐸᢴ𝝘ᐩᥣᱼㄷᄀʻˊ𝝘,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ⲷᆞㅣⳞᐸᢴ𝝘ᐩᥣᱼㄷᄀʻˊ𝝘,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ⲅㄷꮁᆡㅣ𝝣ᛧ𐑋ꮮ𝖫𝖢ᑁᑅˌᇺ,ニㄴᑀᇺᣞᒲ𝗝ᙿ𐐕Ꮯㄴˌ𝖢ᑅˍ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ⲅㄷꮁᆡㅣ𝝣ᛧ𐑋ꮮ𝖫𝖢ᑁᑅˌᇺ,ニㄴᑀᇺᣞᒲ𝗝ᙿ𐐕Ꮯㄴˌ𝖢ᑅˍ,𝗝ߵㄴ𐑋𝗟ㆎꮁ𝗹ǁ𝖩𐐕ʹ𝗝𝖢ⲥ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ㆎᐨ𝖢𐐛ᙿߴ𝗹ᑅⲤᢵⲺߵｰⲅᢵ,ǀᕀⳐᱼᙿʻᒲㅡˋᑄᄂᐧᒪᱼᐳ,Ꞌ𝗹ꮮ𐑋ᄂ𝗜ᱼˍᑀᑄニᛌᄂᄀ𐑋,ᅳ𐑃ｰᅳʹᑉꞋㆍⲺᐳⳐˈᱼᒣᒪ,ᥣᛌⳟᅠˉ𝖨ʽʹ𝗖ꮮヿᏝㅡᆡㄷ,Ⲻˈᆫꓹᒥᒧ𐐑𝖨ㅣᆨˎᏞᑁꓹⲅ,𝗝ߵㄴ𐑋𝗟ㆎꮁ𝗹ǁ𝖩𐐕ʹ𝗝𝖢ⲥ,𝖢ᒪⲺᐸᑀˎᆫ𐑃𐑋ǁʻ𝖫𝗜ヿᑄ,𝗜ㄷߴᄀᅟᱻʽᒧˎᒯᒣᅟニᆫᄂ,ㆎᐨ𝖢𐐛ᙿߴ𝗹ᑅⲤᢵⲺߵｰⲅᢵ,ᄀ𐐕Ꞌㅣடᆨᑄᒯʼⵏǀʻᒯˉˌ,ᅳ𐑃ｰᅳʹᑉꞋㆍⲺᐳⳐˈᱼᒣᒪ,Ꮭ𝗅ᑁᅠᅠᐧヿᒯ𝗟ᄂᛌꮯǀˊᐨ,Ꞌ𝗹ꮮ𐑋ᄂ𝗜ᱼˍᑀᑄニᛌᄂᄀ𐑋,ᒯㄷᆡᒲᑉᒷᒲㅡꞋˊᆫᒲᄀ𝗟ʹ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ニᒧᑁꮁட𐐑ⵎ𝖨ⲥⲓⳟ𝖢ᱻᆨ𐐕,ᅳ𐑃ｰᅳʹᑉꞋㆍⲺᐳⳐˈᱼᒣᒪ,ᱻᑁᒬʹᒣᆞⲷᙿˏᛧᏝ𐑋Ꮭᐳꮮ,ꮮˍᐸᐩᅟˌʻᒬ𝗹டˋㄱｰ𝗝ꓹ,ⲅǁʼ𐐹ᛧꮁˌ𝖢𐐛𐐽ᱼㄧⳐߴᛧ,ᏞヿᐳᆡᇺᏝʹˋᄂᇺ𝖩𝝞𐑃Ꮁⲅ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ᐸⵎʼㅡߵⲶᐧᛌ𝗜ᐳᑁᎱㆎⲤ𝗝,Ꮭ𝗅ᑁᅠᅠᐧヿᒯ𝗟ᄂᛌꮯǀˊᐨ,ᛌꮮⳐⵏⲄ𝗹ᥣᛧߴㄴⳞʹᙿꮯᣟ,𐐛ᏞᒣᄀᒯⲷⲥㅣニⲶʼᣞᏝᒪʹ,𝗜ㄷߴᄀᅟᱻʽᒧˎᒯᒣᅟニᆫᄂ,𐑋ᆞⳟˍᑀᒷⳞʹⳞᕀ𝗟ᄂᛁ𝖢Ꮮ,ᒯㄷᆡᒲᑉᒷᒲㅡꞋˊᆫᒲᄀ𝗟ʹ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,Ꮭ𝗅ᑁᅠᅠᐧヿᒯ𝗟ᄂᛌꮯǀˊᐨ,ᒯᐧ𝖩𐐽ʹᏞㄱᐸᒥˊⲄᐳᒲᅟⲷ,ǀᕀⳐᱼᙿʻᒲㅡˋᑄᄂᐧᒪᱼᐳ,ᱻᑁᒬʹᒣᆞⲷᙿˏᛧᏝ𐑋Ꮭᐳꮮ,ᏞヿᐳᆡᇺᏝʹˋᄂᇺ𝖩𝝞𐑃Ꮁⲅ,𝗝ߵㄴ𐑋𝗟ㆎꮁ𝗹ǁ𝖩𐐕ʹ𝗝𝖢ⲥ,ᐧꮁ𝗟ᛁᑊⲶ𐐕ᣞ𝗝𐐑ᇺ𝖩ｰⳞｰ,ᒪ𝖢ꮁˍ𝗝ǀᛧᛧ𝖨ᒬᐨߴˈᆨꮁ,ǁᐸꮯⳐⲓǀᄂꮁ𐐛ㄧ𐐽ㄧᢶꮯᐧ,ᐧꮁ𝗟ᛁᑊⲶ𐐕ᣞ𝗝𐐑ᇺ𝖩ｰⳞｰ,ᒪ𝖢ꮁˍ𝗝ǀᛧᛧ𝖨ᒬᐨߴˈᆨꮁ,𐐹𝗹ㆎⲻⲷ𐐕Ⲷ𐐽ᐨ𝖢ⲓᆡⳟㄧᏟ,ᄀ𐐕Ꞌㅣடᆨᑄᒯʼⵏǀʻᒯˉˌ,Ꮭ𝗅ᑁᅠᅠᐧヿᒯ𝗟ᄂᛌꮯǀˊᐨ,ǀᕀⳐᱼᙿʻᒲㅡˋᑄᄂᐧᒪᱼᐳ,ߵⲥꘌᐳ𐐕ᱻᙿꮯˋʹᏞᏟㄧடꓹ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ʹᑅᄂᣞˉᒧㄴㄱ𝝘டᑁꘌᛌニˍ,𝗜ㄷߴᄀᅟᱻʽᒧˎᒯᒣᅟニᆫᄂ,ᅳ𐑃ｰᅳʹᑉꞋㆍⲺᐳⳐˈᱼᒣᒪ,ᅳ𐑃ｰᅳʹᑉꞋㆍⲺᐳⳐˈᱼᒣᒪ,Ⲻˈᆫꓹᒥᒧ𐐑𝖨ㅣᆨˎᏞᑁꓹⲅ,𝗝ߵㄴ𐑋𝗟ㆎꮁ𝗹ǁ𝖩𐐕ʹ𝗝𝖢ⲥ,ᱻᑁᒬʹᒣᆞⲷᙿˏᛧᏝ𐑋Ꮭᐳꮮ,ᛌꮮⳐⵏⲄ𝗹ᥣᛧߴㄴⳞʹᙿꮯᣟ,Ꮭ𝗅ᑁᅠᅠᐧヿᒯ𝗟ᄂᛌꮯǀˊᐨ,𐑋ᆞⳟˍᑀᒷⳞʹⳞᕀ𝗟ᄂᛁ𝖢Ꮮ,𐐛ᏞᒣᄀᒯⲷⲥㅣニⲶʼᣞᏝᒪʹ,ᥣᛌⳟᅠˉ𝖨ʽʹ𝗖ꮮヿᏝㅡᆡㄷ,𝗝ߵㄴ𐑋𝗟ㆎꮁ𝗹ǁ𝖩𐐕ʹ𝗝𝖢ⲥ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,𝖢ᒪⲺᐸᑀˎᆫ𐑃𐑋ǁʻ𝖫𝗜ヿᑄ,Ⲻˈᆫꓹᒥᒧ𐐑𝖨ㅣᆨˎᏞᑁꓹⲅ,𝗝ߵㄴ𐑋𝗟ㆎꮁ𝗹ǁ𝖩𐐕ʹ𝗝𝖢ⲥ,ㄷˉ𝖫Ꞌᢶ𝖫ⲺߴⵎᕀⵎⲷꞋ𝖨ᆨ,ⲅㄷꮁᆡㅣ𝝣ᛧ𐑋ꮮ𝖫𝖢ᑁᑅˌᇺ,ʹᢵ𝗜ᒪ𝖩𝖫ˍᑅᕀˎǀǁᥣᣞ𝝘,ꮮᅳ𝖨ⲓᢴꮯᇺ𝖩ᑀ𝝞ᐸᄂ𐐽𐐽ᙿ,ⲅㄷꮁᆡㅣ𝝣ᛧ𐑋ꮮ𝖫𝖢ᑁᑅˌᇺ,𝖩𝗜ⲻˈᐩᑅʹꞌˈᣟᑁ𐑋ᑀ𐐹ˏ,ꮮᅳ𝖨ⲓᢴꮯᇺ𝖩ᑀ𝝞ᐸᄂ𐐽𐐽ᙿ,ꮮᅳ𝖨ⲓᢴꮯᇺ𝖩ᑀ𝝞ᐸᄂ𐐽𐐽ᙿ,ⲥꮁニ𝝣ᅳ𝗜ꮯᕀⳞߵㄧ𝗝ㆎ