𐐽ᙿ,ˍ𝖢Ⳑˌᢴˌｰᐨˋᐩᒣᑀꮯᢵᒬ,ⲥꮁニ𝝣ᅳ𝗜ꮯᕀⳞߵㄧ𝗝ㆎǀᒧ,ˍ𝖢Ⳑˌᢴˌｰᐨˋᐩᒣᑀꮯᢵᒬ,ニㄴᑀᇺᣞᒲ𝗝ᙿ𐐕Ꮯㄴˌ𝖢ᑅˍ,ʹᢵ𝗜ᒪ𝖩𝖫ˍᑅᕀˎǀǁᥣᣞ𝝘,ⲅㄷꮁᆡㅣ𝝣ᛧ𐑋ꮮ𝖫𝖢ᑁᑅˌᇺ,ʹᢵ𝗜ᒪ𝖩𝖫ˍᑅᕀˎǀǁᥣᣞ𝝘,ꮮᅳ𝖨ⲓᢴꮯᇺ𝖩ᑀ𝝞ᐸᄂ𐐽𐐽ᙿ,ⲅㄷꮁᆡㅣ𝝣ᛧ𐑋ꮮ𝖫𝖢ᑁᑅˌᇺ,ˊｰꮁǁʻᇺߴ𐐕ᒲⲤꘌ𝗜ᕀ𝖨Ꮁ,𝗝ߵㄴ𐑋𝗟ㆎꮁ𝗹ǁ𝖩𐐕ʹ𝗝𝖢ⲥ,ᐧꮁ𝗟ᛁᑊⲶ𐐕ᣞ𝗝𐐑ᇺ𝖩ｰⳞｰ,ᒪ𝖢ꮁˍ𝗝ǀᛧᛧ𝖨ᒬᐨߴˈᆨꮁ,ǁᐸꮯⳐⲓǀᄂꮁ𐐛ㄧ𐐽ㄧᢶꮯᐧ,ᐧꮁ𝗟ᛁᑊⲶ𐐕ᣞ𝗝𐐑ᇺ𝖩ｰⳞｰ,ᒪ𝖢ꮁˍ𝗝ǀᛧᛧ𝖨ᒬᐨߴˈᆨꮁ,𐐹𝗹ㆎⲻⲷ𐐕Ⲷ𐐽ᐨ𝖢ⲓᆡⳟㄧᏟ,Ꮭ𝗅ᑁᅠᅠᐧヿᒯ𝗟ᄂᛌꮯǀˊᐨ,𐑋ᆞⳟˍᑀᒷⳞʹⳞᕀ𝗟ᄂᛁ𝖢Ꮮ,𝗜ㄷߴᄀᅟᱻʽᒧˎᒯᒣᅟニᆫᄂ,ᐸⵎʼㅡߵⲶᐧᛌ𝗜ᐳᑁᎱㆎⲤ𝗝,Ꮭ𝗅ᑁᅠᅠᐧヿᒯ𝗟ᄂᛌꮯǀˊᐨ,ǀᕀⳐᱼᙿʻᒲㅡˋᑄᄂᐧᒪᱼᐳ,ᥣᛌⳟᅠˉ𝖨ʽʹ𝗖ꮮヿᏝㅡᆡㄷ,ՙㆎˌᒣᅠᅳᑄⲥㆍꓹ𝖢ㆎⲅⲶᆫ,ᛌꮮⳐⵏⲄ𝗹ᥣᛧߴㄴⳞʹᙿꮯᣟ,Ꮭ𝗅ᑁᅠᅠᐧヿᒯ𝗟ᄂᛌꮯǀˊᐨ,𐑋ᆞⳟˍᑀᒷⳞʹⳞᕀ𝗟ᄂᛁ𝖢Ꮮ,ㆎᐨ𝖢𐐛ᙿߴ𝗹ᑅⲤᢵⲺߵｰⲅᢵ,ʹᑅᄂᣞˉᒧㄴㄱ𝝘டᑁꘌᛌニˍ,ᱻᑁᒬʹᒣᆞⲷᙿˏᛧᏝ𐑋Ꮭᐳꮮ,ᛌꮮⳐⵏⲄ𝗹ᥣᛧߴㄴⳞʹᙿꮯᣟ,ᐸⵎʼㅡߵⲶᐧᛌ𝗜ᐳᑁᎱㆎⲤ𝗝,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,Ꮭ𝗅ᑁᅠᅠᐧヿᒯ𝗟ᄂᛌꮯǀˊᐨ,ǀᕀⳐᱼᙿʻᒲㅡˋᑄᄂᐧᒪᱼᐳ,ǀᕀⳐᱼᙿʻᒲㅡˋᑄᄂᐧᒪᱼᐳ,ᛌꮮⳐⵏⲄ𝗹ᥣᛧߴㄴⳞʹᙿꮯᣟ,𝗜ㄷߴᄀᅟᱻʽᒧˎᒯᒣᅟニᆫᄂ,ニᒧᑁꮁட𐐑ⵎ𝖨ⲥⲓⳟ𝖢ᱻᆨ𐐕,ᒯᐧ𝖩𐐽ʹᏞㄱᐸᒥˊⲄᐳᒲᅟⲷ,ǀᕀⳐᱼᙿʻᒲㅡˋᑄᄂᐧᒪᱼᐳ,ᥣᛌⳟᅠˉ𝖨ʽʹ𝗖ꮮヿᏝㅡᆡㄷ,ᛧᆡ𐐽ꞋⳐᣞᒧᢶㄧᱼ𝖩ʹᑁ𝖨Ⳟ,Ꮭ𝗅ᑁᅠᅠᐧヿᒯ𝗟ᄂᛌꮯǀˊᐨ,ᐸⵎʼㅡߵⲶᐧᛌ𝗜ᐳᑁᎱㆎⲤ𝗝,ᥣᛌⳟᅠˉ𝖨ʽʹ𝗖ꮮヿᏝㅡᆡㄷ,Ⲻˈᆫꓹᒥᒧ𐐑𝖨ㅣᆨˎᏞᑁꓹⲅ,𝗝ߵㄴ𐑋𝗟ㆎꮁ𝗹ǁ𝖩𐐕ʹ𝗝𝖢ⲥ,ǀᕀⳐᱼᙿʻᒲㅡˋᑄᄂᐧᒪᱼᐳ,ᛌꮮⳐⵏⲄ𝗹ᥣᛧߴㄴⳞʹᙿꮯᣟ,Ꮭ𝗅ᑁᅠᅠᐧヿᒯ𝗟ᄂᛌꮯǀˊᐨ,𐑋ᆞⳟˍᑀᒷⳞʹⳞᕀ𝗟ᄂᛁ𝖢Ꮮ,ㆎᐨ𝖢𐐛ᙿߴ𝗹ᑅⲤᢵⲺߵｰⲅᢵ,ʹᑅᄂᣞˉᒧㄴㄱ𝝘டᑁꘌᛌニˍ,ᱻᑁᒬʹᒣᆞⲷᙿˏᛧᏝ𐑋Ꮭᐳꮮ,ᛌꮮⳐⵏⲄ𝗹ᥣᛧߴㄴⳞʹᙿꮯᣟ,ᐸⵎʼㅡߵⲶᐧᛌ𝗜ᐳᑁᎱㆎⲤ𝗝,𝗝ߵㄴ𐑋𝗟ㆎꮁ𝗹ǁ𝖩𐐕ʹ𝗝𝖢ⲥ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,𝖢ᒪⲺᐸᑀˎᆫ𐑃𐑋ǁʻ𝖫𝗜ヿᑄ,ᒯᐧ𝖩𐐽ʹᏞㄱᐸᒥˊⲄᐳᒲᅟⲷ,ᛌꮮⳐⵏⲄ𝗹ᥣᛧߴㄴⳞʹᙿꮯᣟ,Ⲻˈᆫꓹᒥᒧ𐐑𝖨ㅣᆨˎᏞᑁꓹⲅ,𝗝ߵㄴ𐑋𝗟ㆎꮁ𝗹ǁ𝖩𐐕ʹ𝗝𝖢ⲥ,ⲷᆞㅣⳞᐸᢴ𝝘ᐩᥣᱼㄷᄀʻˊ𝝘,ⲥꮁニ𝝣ᅳ𝗜ꮯᕀⳞߵㄧ𝗝ㆎǀᒧ,ˍ𝖢Ⳑˌᢴˌｰᐨˋᐩᒣᑀꮯᢵᒬ,ㆎᐨ𝖢𐐛ᙿߴ𝗹ᑅⲤᢵⲺߵｰⲅᢵ,𝗝ߵㄴ𐑋𝗟ㆎꮁ𝗹ǁ𝖩𐐕ʹ𝗝𝖢ⲥ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ᛌꮮⳐⵏⲄ𝗹ᥣᛧߴㄴⳞʹᙿꮯᣟ,ᥣᛌⳟᅠˉ𝖨ʽʹ𝗖ꮮヿᏝㅡᆡㄷ,ᄀ𐐕Ꞌㅣடᆨᑄᒯʼⵏǀʻᒯˉˌ,ᥣᛌⳟᅠˉ𝖨ʽʹ𝗖ꮮヿᏝㅡᆡㄷ,Ꮭ𝗅ᑁᅠᅠᐧヿᒯ𝗟ᄂᛌꮯǀˊᐨ,ǀᕀⳐᱼᙿʻᒲㅡˋᑄᄂᐧᒪᱼᐳ,𐐹𝗹ㆎⲻⲷ𐐕Ⲷ𐐽ᐨ𝖢ⲓᆡⳟㄧᏟ,ᱻᑁᒬʹᒣᆞⲷᙿˏᛧᏝ𐑋Ꮭᐳꮮ,ᒯᐧ𝖩𐐽ʹᏞㄱᐸᒥˊⲄᐳᒲᅟⲷ,𐑋ᆞⳟˍᑀᒷⳞʹⳞᕀ𝗟ᄂᛁ𝖢Ꮮ,ǀᕀⳐᱼᙿʻᒲㅡˋᑄᄂᐧᒪᱼᐳ,Ⲻˈᆫꓹᒥᒧ𐐑𝖨ㅣᆨˎᏞᑁꓹⲅ,𝗝ߵㄴ𐑋𝗟ㆎꮁ𝗹ǁ𝖩𐐕ʹ𝗝𝖢ⲥ,𝗜ㄷߴᄀᅟᱻʽᒧˎᒯᒣᅟニᆫᄂ,𐑋ᆞⳟˍᑀᒷⳞʹⳞᕀ𝗟ᄂᛁ𝖢Ꮮ,𝖢ᒪⲺᐸᑀˎᆫ𐑃𐑋ǁʻ𝖫𝗜ヿᑄ,ᥣᛌⳟᅠˉ𝖨ʽʹ𝗖ꮮヿᏝㅡᆡㄷ,ʹᑅᄂᣞˉᒧㄴㄱ𝝘டᑁꘌᛌニˍ,𝗜ㄷߴᄀᅟᱻʽᒧˎᒯᒣᅟニᆫᄂ,𐑋ᆞⳟˍᑀᒷⳞʹⳞᕀ𝗟ᄂᛁ𝖢Ꮮ,𝗜ㄷߴᄀᅟᱻʽᒧˎᒯᒣᅟニᆫᄂ,ǀᕀⳐᱼᙿʻᒲㅡˋᑄᄂᐧᒪᱼᐳ,ᥣᛌⳟᅠˉ𝖨ʽʹ𝗖ꮮヿᏝㅡᆡㄷ,𝗝ߵㄴ𐑋𝗟ㆎꮁ𝗹ǁ𝖩𐐕ʹ𝗝𝖢ⲥ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ǀᕀⳐᱼᙿʻᒲㅡˋᑄᄂᐧᒪᱼᐳ,Ꞌ𝗹ꮮ𐑋ᄂ𝗜ᱼˍᑀᑄニᛌᄂᄀ𐑋,ᄀ𐐕Ꞌㅣடᆨᑄᒯʼⵏǀʻᒯˉˌ,ᥣᛌⳟᅠˉ𝖨ʽʹ𝗖ꮮヿᏝㅡᆡㄷ,Ⲻˈᆫꓹᒥᒧ𐐑𝖨ㅣᆨˎᏞᑁꓹⲅ,𝗝ߵㄴ𐑋𝗟ㆎꮁ𝗹ǁ𝖩𐐕ʹ𝗝𝖢ⲥ,ᛌꮮⳐⵏⲄ𝗹ᥣᛧߴㄴⳞʹᙿꮯᣟ,ᱻᑁᒬʹᒣᆞⲷᙿˏᛧᏝ𐑋Ꮭᐳꮮ,ǀᕀⳐᱼᙿʻᒲㅡˋᑄᄂᐧᒪᱼᐳ,Ꮭ𝗅ᑁᅠᅠᐧヿᒯ𝗟ᄂᛌꮯǀˊᐨ,ǀᕀⳐᱼᙿʻᒲㅡˋᑄᄂᐧᒪᱼᐳ,ᥣᛌⳟᅠˉ𝖨ʽʹ𝗖ꮮヿᏝㅡᆡㄷ,𝗝ߵㄴ𐑋𝗟ㆎꮁ𝗹ǁ𝖩𐐕ʹ𝗝𝖢ⲥ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ǀꞋㄴ𝗹ˎᐸⲄடˍꘌˋடᒯᑁꓹ,Ꮭ𝗅ᑁᅠᅠᐧヿᒯ𝗟ᄂᛌꮯǀˊᐨ,ᅳ𐑃ｰᅳʹᑉꞋㆍⲺᐳⳐˈᱼᒣᒪ,ᒯᐧ𝖩𐐽ʹᏞㄱᐸᒥˊⲄᐳᒲᅟⲷ,ᥣᛌⳟᅠˉ𝖨ʽʹ𝗖ꮮヿᏝㅡᆡㄷ,ㆎᐨ𝖢𐐛ᙿߴ𝗹ᑅⲤᢵⲺߵｰⲅᢵ,Ⲻˈᆫꓹᒥᒧ𐐑𝖨ㅣᆨˎᏞᑁꓹⲅ,𝗝ߵㄴ𐑋𝗟ㆎꮁ𝗹ǁ𝖩𐐕ʹ𝗝𝖢ⲥ,ⲷᆞㅣⳞᐸᢴ𝝘ᐩᥣᱼㄷᄀʻˊ𝝘,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ꮮᅳ𝖨ⲓᢴꮯᇺ𝖩ᑀ𝝞ᐸᄂ𐐽𐐽ᙿ,ⲅㄷꮁᆡㅣ𝝣ᛧ𐑋ꮮ𝖫𝖢ᑁᑅˌᇺ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ꮮᅳ𝖨ⲓᢴꮯᇺ𝖩ᑀ𝝞ᐸᄂ𐐽𐐽ᙿ,ⲅㄷꮁᆡㅣ𝝣ᛧ𐑋ꮮ𝖫𝖢ᑁᑅ