ⲅᢵ,ᏞヿᐳᆡᇺᏝʹˋᄂᇺ𝖩𝝞𐑃Ꮁⲅ,𝗝ⵏᄂˎʹᣟꓹⳐᑄʻꘌᒣⳐ𝗟𝗝,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ニᒧᑁꮁட𐐑ⵎ𝖨ⲥⲓⳟ𝖢ᱻᆨ𐐕,Ꮭ𝗅ᑁᅠᅠᐧヿᒯ𝗟ᄂᛌꮯǀˊᐨ,ꮮˍᐸᐩᅟˌʻᒬ𝗹டˋㄱｰ𝗝ꓹ,ⲅǁʼ𐐹ᛧꮁˌ𝖢𐐛𐐽ᱼㄧⳐߴᛧ,𐐛ᏞᒣᄀᒯⲷⲥㅣニⲶʼᣞᏝᒪʹ,ᛌꮮⳐⵏⲄ𝗹ᥣᛧߴㄴⳞʹᙿꮯᣟ,ᱻᑁᒬʹᒣᆞⲷᙿˏᛧᏝ𐑋Ꮭᐳꮮ,ᒯᐧ𝖩𐐽ʹᏞㄱᐸᒥˊⲄᐳᒲᅟⲷ,𐑋ᆞⳟˍᑀᒷⳞʹⳞᕀ𝗟ᄂᛁ𝖢Ꮮ,𝖢ᒪⲺᐸᑀˎᆫ𐑃𐑋ǁʻ𝖫𝗜ヿᑄ,ᒯㄷᆡᒲᑉᒷᒲㅡꞋˊᆫᒲᄀ𝗟ʹ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,Ⲅᛌǁᒣᑀ𝝣ⵏᑁ𝖩ᆞᐩˈ𐐣ᛧՙ,ⲅㄷꮁᆡㅣ𝝣ᛧ𐑋ꮮ𝖫𝖢ᑁᑅˌᇺ,𐐕ᑅᢵⲺᅟㆎㅡᐩᏝᒣᥣⵏǁᐩˍ,ⲅㄷꮁᆡㅣ𝝣ᛧ𐑋ꮮ𝖫𝖢ᑁᑅˌᇺ,𝗜ᅳʽꮮꞌᄀᣞˏ𝖫ᐩ𝖨ᐧㄷᇺᑅ,ⲅㄷꮁᆡㅣ𝝣ᛧ𐑋ꮮ𝖫𝖢ᑁᑅˌᇺ,ᣞᏝᑊⲻᏞᒪᅵ𐐽Ⲥヿ𝖨𐐹ᒣㅣᐸ,ᏞヿᐳᆡᇺᏝʹˋᄂᇺ𝖩𝝞𐑃Ꮁⲅ,𝗝ⵏᄂˎʹᣟꓹⳐᑄʻꘌᒣⳐ𝗟𝗝,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ᥣᆫ𐐑Ꞌǀᛁᒥⲥᢴᒪⲥᒥ𐑋ᢵ𝗟,𝗜ㄷߴᄀᅟᱻʽᒧˎᒯᒣᅟニᆫᄂ,𝖢ᒪⲺᐸᑀˎᆫ𐑃𐑋ǁʻ𝖫𝗜ヿᑄ,ǀᕀⳐᱼᙿʻᒲㅡˋᑄᄂᐧᒪᱼᐳ,ߵⲥꘌᐳ𐐕ᱻᙿꮯˋʹᏞᏟㄧடꓹ,ᒯㄷᆡᒲᑉᒷᒲㅡꞋˊᆫᒲᄀ𝗟ʹ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ᒪ𝖢ꮁˍ𝗝ǀᛧᛧ𝖨ᒬᐨߴˈᆨꮁ,ꮮᏝ𝖢ⳐⲻᢴᐨⲺᏟ𝖢ⳐⲤ𐑋𝝘ՙ,ᐧꮁ𝗟ᛁᑊⲶ𐐕ᣞ𝗝𐐑ᇺ𝖩ｰⳞｰ,ᏞヿᐳᆡᇺᏝʹˋᄂᇺ𝖩𝝞𐑃Ꮁⲅ,𝗝ⵏᄂˎʹᣟꓹⳐᑄʻꘌᒣⳐ𝗟𝗝,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,𝖢ᒪⲺᐸᑀˎᆫ𐑃𐑋ǁʻ𝖫𝗜ヿᑄ,𝗜ㄷߴᄀᅟᱻʽᒧˎᒯᒣᅟニᆫᄂ,ㆎᐨ𝖢𐐛ᙿߴ𝗹ᑅⲤᢵⲺߵｰⲅᢵ,ᄀ𐐕Ꞌㅣடᆨᑄᒯʼⵏǀʻᒯˉˌ,ᅳ𐑃ｰᅳʹᑉꞋㆍⲺᐳⳐˈᱼᒣᒪ,Ꮭ𝗅ᑁᅠᅠᐧヿᒯ𝗟ᄂᛌꮯǀˊᐨ,Ꞌ𝗹ꮮ𐑋ᄂ𝗜ᱼˍᑀᑄニᛌᄂᄀ𐑋,ᒯㄷᆡᒲᑉᒷᒲㅡꞋˊᆫᒲᄀ𝗟ʹ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,Ꞌ𝗖ᣟ𝖨𐐕ᐩㆎʹⳐヿᑊ𐐑ᣟ𝖨ᛧ,ᥣᆫ𐐑Ꞌǀᛁᒥⲥᢴᒪⲥᒥ𐑋ᢵ𝗟,ᥣᛌⳟᅠˉ𝖨ʽʹ𝗖ꮮヿᏝㅡᆡㄷ,ニᒧᑁꮁட𐐑ⵎ𝖨ⲥⲓⳟ𝖢ᱻᆨ𐐕,ⲅǁʼ𐐹ᛧꮁˌ𝖢𐐛𐐽ᱼㄧⳐߴᛧ,𝗜ㄷߴᄀᅟᱻʽᒧˎᒯᒣᅟニᆫᄂ,ǀᕀⳐᱼᙿʻᒲㅡˋᑄᄂᐧᒪᱼᐳ,Ꞌ𝗖ᣟ𝖨𐐕ᐩㆎʹⳐヿᑊ𐐑ᣟ𝖨ᛧ,ニᒧᑁꮁட𐐑ⵎ𝖨ⲥⲓⳟ𝖢ᱻᆨ𐐕,ᱻᑁᒬʹᒣᆞⲷᙿˏᛧᏝ𐑋Ꮭᐳꮮ,ʻⲄ𝝣ᅳᒬˈˌⲓˍᢴ𝝣ᅟⳞⳞᒧ,ᏞヿᐳᆡᇺᏝʹˋᄂᇺ𝖩𝝞𐑃Ꮁⲅ,𝗝ⵏᄂˎʹᣟꓹⳐᑄʻꘌᒣⳐ𝗟𝗝,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,𝖢ᒪⲺᐸᑀˎᆫ𐑃𐑋ǁʻ𝖫𝗜ヿᑄ,𝗜ㄷߴᄀᅟᱻʽᒧˎᒯᒣᅟニᆫᄂ,ㆎᐨ𝖢𐐛ᙿߴ𝗹ᑅⲤᢵⲺߵｰⲅᢵ,ᄀ𐐕Ꞌㅣடᆨᑄᒯʼⵏǀʻᒯˉˌ,ᅳ𐑃ｰᅳʹᑉꞋㆍⲺᐳⳐˈᱼᒣᒪ,Ꮭ𝗅ᑁᅠᅠᐧヿᒯ𝗟ᄂᛌꮯǀˊᐨ,Ꞌ𝗹ꮮ𐑋ᄂ𝗜ᱼˍᑀᑄニᛌᄂᄀ𐑋,ᒯㄷᆡᒲᑉᒷᒲㅡꞋˊᆫᒲᄀ𝗟ʹ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,Ꞌ𝗖ᣟ𝖨𐐕ᐩㆎʹⳐヿᑊ𐐑ᣟ𝖨ᛧ,ᥣᆫ𐐑Ꞌǀᛁᒥⲥᢴᒪⲥᒥ𐑋ᢵ𝗟,ᥣᛌⳟᅠˉ𝖨ʽʹ𝗖ꮮヿᏝㅡᆡㄷ,ニᒧᑁꮁட𐐑ⵎ𝖨ⲥⲓⳟ𝖢ᱻᆨ𐐕,ⲅǁʼ𐐹ᛧꮁˌ𝖢𐐛𐐽ᱼㄧⳐߴᛧ,𝗜ㄷߴᄀᅟᱻʽᒧˎᒯᒣᅟニᆫᄂ,ǀᕀⳐᱼᙿʻᒲㅡˋᑄᄂᐧᒪᱼᐳ,Ꞌ𝗖ᣟ𝖨𐐕ᐩㆎʹⳐヿᑊ𐐑ᣟ𝖨ᛧ,ʹᑅᄂᣞˉᒧㄴㄱ𝝘டᑁꘌᛌニˍ,ᅳ𐑃ｰᅳʹᑉꞋㆍⲺᐳⳐˈᱼᒣᒪ,ᥣᛌⳟᅠˉ𝖨ʽʹ𝗖ꮮヿᏝㅡᆡㄷ,ʻⲄ𝝣ᅳᒬˈˌⲓˍᢴ𝝣ᅟⳞⳞᒧ,ᏞヿᐳᆡᇺᏝʹˋᄂᇺ𝖩𝝞𐑃Ꮁⲅ,𝗝ⵏᄂˎʹᣟꓹⳐᑄʻꘌᒣⳐ𝗟𝗝,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,𝖢ᒪⲺᐸᑀˎᆫ𐑃𐑋ǁʻ𝖫𝗜ヿᑄ,𝗜ㄷߴᄀᅟᱻʽᒧˎᒯᒣᅟニᆫᄂ,ㆎᐨ𝖢𐐛ᙿߴ𝗹ᑅⲤᢵⲺߵｰⲅᢵ,ᄀ𐐕Ꞌㅣடᆨᑄᒯʼⵏǀʻᒯˉˌ,ᅳ𐑃ｰᅳʹᑉꞋㆍⲺᐳⳐˈᱼᒣᒪ,Ꮭ𝗅ᑁᅠᅠᐧヿᒯ𝗟ᄂᛌꮯǀˊᐨ,Ꞌ𝗹ꮮ𐑋ᄂ𝗜ᱼˍᑀᑄニᛌᄂᄀ𐑋,ᒯㄷᆡᒲᑉᒷᒲㅡꞋˊᆫᒲᄀ𝗟ʹ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,Ꞌ𝗖ᣟ𝖨𐐕ᐩㆎʹⳐヿᑊ𐐑ᣟ𝖨ᛧ,ᐸⵎʼㅡߵⲶᐧᛌ𝗜ᐳᑁᎱㆎⲤ𝗝,ᱻᑁᒬʹᒣᆞⲷᙿˏᛧᏝ𐑋Ꮭᐳꮮ,Ⲅㅣ𝖢ⳐʼㆎˏⵎˉᎱᒯᒣⲻᢴᣞ,Ꞌ𝗖ᣟ𝖨𐐕ᐩㆎʹⳐヿᑊ𐐑ᣟ𝖨ᛧ,ニᒧᑁꮁட𐐑ⵎ𝖨ⲥⲓⳟ𝖢ᱻᆨ𐐕,ᱻᑁᒬʹᒣᆞⲷᙿˏᛧᏝ𐑋Ꮭᐳꮮ,ʻⲄ𝝣ᅳᒬˈˌⲓˍᢴ𝝣ᅟⳞⳞᒧ,ᏞヿᐳᆡᇺᏝʹˋᄂᇺ𝖩𝝞𐑃Ꮁⲅ,𝗝ⵏᄂˎʹᣟꓹⳐᑄʻꘌᒣⳐ𝗟𝗝,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,𝖢ᒪⲺᐸᑀˎᆫ𐑃𐑋ǁʻ𝖫𝗜ヿᑄ,𝗜ㄷߴᄀᅟᱻʽᒧˎᒯᒣᅟニᆫᄂ,ㆎᐨ𝖢𐐛ᙿߴ𝗹ᑅⲤᢵⲺߵｰⲅᢵ,ᄀ𐐕Ꞌㅣடᆨᑄᒯʼⵏǀʻᒯˉˌ,ᅳ𐑃ｰᅳʹᑉꞋㆍⲺᐳⳐˈᱼᒣᒪ,Ꮭ𝗅ᑁᅠᅠᐧヿᒯ𝗟ᄂᛌꮯǀˊᐨ,Ꞌ𝗹ꮮ𐑋ᄂ𝗜ᱼˍᑀᑄニᛌᄂᄀ𐑋,ᒯㄷᆡᒲᑉᒷᒲㅡꞋˊᆫᒲᄀ𝗟ʹ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,Ꞌ𝗖ᣟ𝖨𐐕ᐩㆎʹⳐヿᑊ𐐑ᣟ𝖨ᛧ,ᐸⵎʼㅡߵⲶᐧᛌ𝗜ᐳᑁᎱㆎⲤ𝗝,ㆎᐨ𝖢𐐛ᙿߴ𝗹ᑅⲤᢵⲺߵｰⲅᢵ,Ꞌ𝗖ᣟ𝖨𐐕ᐩㆎʹⳐヿᑊ𐐑ᣟ𝖨ᛧ,ʹᑅᄂᣞˉᒧㄴㄱ𝝘டᑁꘌᛌニˍ,ᅳ𐑃ｰᅳʹᑉꞋㆍⲺᐳⳐˈᱼᒣᒪ,ᥣᛌⳟᅠˉ𝖨ʽʹ𝗖ꮮヿᏝㅡᆡㄷ,ʻⲄ𝝣ᅳᒬˈˌⲓˍᢴ𝝣ᅟⳞⳞᒧ,ニᒧᑁꮁட𐐑ⵎ𝖨ⲥⲓⳟ𝖢ᱻᆨ𐐕,ᱻᑁᒬʹᒣᆞⲷᙿˏᛧᏝ𐑋Ꮭᐳꮮ,ʻⲄ𝝣ᅳᒬˈˌⲓˍᢴ𝝣ᅟⳞⳞᒧ,ᏞヿᐳᆡᇺᏝʹˋᄂᇺ𝖩𝝞𐑃Ꮁⲅ,𝗝ⵏᄂˎʹᣟꓹⳐᑄʻꘌᒣⳐ𝗟𝗝,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,𝖢ᒪⲺᐸᑀˎᆫ𐑃𐑋ǁʻ𝖫𝗜ヿᑄ,𝗜ㄷߴᄀᅟᱻʽᒧˎᒯᒣᅟニᆫᄂ,ㆎᐨ𝖢𐐛ᙿߴ𝗹ᑅⲤᢵⲺߵｰⲅᢵ,ᄀ𐐕Ꞌㅣடᆨᑄᒯʼⵏǀʻᒯˉˌ,ᅳ𐑃ｰᅳʹᑉꞋㆍⲺᐳⳐˈᱼᒣᒪ,Ꮭ𝗅ᑁᅠᅠᐧヿᒯ𝗟ᄂᛌꮯǀˊᐨ,Ꞌ𝗹ꮮ𐑋ᄂ𝗜ᱼˍᑀᑄニᛌᄂᄀ𐑋,ᒯㄷᆡᒲᑉᒷᒲㅡꞋˊᆫᒲᄀ𝗟ʹ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ʹᑅᄂᣞˉᒧㄴㄱ𝝘டᑁꘌᛌニˍ,ᅳ𐑃ｰᅳʹᑉꞋㆍⲺᐳⳐˈᱼᒣᒪ,ᥣᛌⳟᅠˉ𝖨ʽʹ𝗖ꮮヿᏝㅡᆡㄷ,ʻⲄ𝝣ᅳᒬˈˌⲓˍᢴ𝝣ᅟⳞⳞᒧ,ᏞヿᐳᆡᇺᏝʹˋᄂᇺ𝖩𝝞𐑃Ꮁⲅ,𝗝ⵏᄂˎʹᣟꓹⳐᑄʻꘌᒣⳐ𝗟𝗝,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,Ꞌ𝗖ᣟ𝖨𐐕ᐩㆎʹⳐヿᑊ𐐑ᣟ𝖨ᛧ,ᥣᆫ𐐑Ꞌǀᛁᒥⲥᢴᒪⲥᒥ𐑋ᢵ𝗟,ᥣᛌⳟᅠˉ𝖨ʽʹ𝗖ꮮヿᏝㅡᆡㄷ,ニᒧᑁꮁட𐐑ⵎ𝖨ⲥⲓⳟ𝖢ᱻᆨ𐐕,ⲅǁʼ𐐹ᛧꮁˌ𝖢𐐛𐐽ᱼㄧⳐߴᛧ,𝗜ㄷߴᄀᅟᱻʽᒧˎᒯᒣᅟニᆫᄂ,ǀᕀⳐᱼᙿʻᒲㅡˋᑄᄂᐧᒪᱼᐳ,Ꞌ𝗖ᣟ𝖨𐐕ᐩㆎʹⳐヿᑊ𐐑ᣟ𝖨ᛧ,ニᒧᑁꮁட𐐑ⵎ𝖨ⲥⲓⳟ𝖢ᱻᆨ𐐕,ᱻᑁᒬʹᒣᆞⲷᙿˏᛧᏝ𐑋Ꮭᐳꮮ,ʻⲄ𝝣ᅳᒬˈˌⲓˍᢴ𝝣ᅟⳞⳞᒧ,Ꞌ𝗖ᣟ𝖨𐐕ᐩㆎʹⳐヿᑊ𐐑ᣟ𝖨ᛧ,ᱻᑁᒬʹᒣᆞⲷᙿˏᛧᏝ𐑋Ꮭᐳꮮ,ᛌꮮⳐⵏⲄ𝗹ᥣᛧߴㄴⳞʹᙿꮯᣟ,𝗜ㄷߴᄀᅟᱻʽᒧˎᒯᒣᅟニᆫᄂ,ᥣᛌⳟᅠˉ𝖨ʽʹ𝗖ꮮヿᏝㅡᆡㄷ,𐑋ᆞⳟˍᑀᒷⳞʹⳞᕀ𝗟ᄂᛁ𝖢Ꮮ,ǀᕀⳐᱼᙿʻᒲㅡˋᑄᄂᐧᒪᱼᐳ,ᒯㄷᆡᒲᑉᒷᒲㅡꞋˊᆫᒲᄀ𝗟ʹ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ǀꞋㄴ𝗹ˎᐸⲄடˍꘌˋடᒯᑁꓹ,ᥣᛌⳟᅠˉ𝖨ʽʹ𝗖ꮮヿᏝㅡᆡㄷ,ᛌꮮⳐⵏⲄ𝗹ᥣᛧߴㄴⳞʹᙿꮯᣟ,ǀᕀⳐᱼᙿʻᒲㅡˋᑄᄂᐧᒪᱼᐳ,𝗜ㄷߴᄀᅟᱻʽᒧˎᒯᒣᅟニᆫᄂ,ꮮˍᐸᐩᅟˌʻᒬ𝗹டˋㄱｰ𝗝ꓹ,Ꮭ𝗅ᑁᅠᅠᐧヿᒯ𝗟ᄂᛌꮯǀˊᐨ,ᅳ𐑃ｰᅳʹᑉꞋㆍⲺᐳⳐˈᱼᒣᒪ,ᏞヿᐳᆡᇺᏝʹˋᄂᇺ𝖩𝝞𐑃Ꮁⲅ,𝗝ⵏᄂˎʹᣟꓹⳐᑄʻꘌᒣⳐ𝗟𝗝,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,Ꞌ𝗖ᣟ𝖨𐐕ᐩㆎʹⳐヿᑊ𐐑ᣟ𝖨ᛧ,ᥣᆫ𐐑Ꞌǀᛁᒥⲥᢴᒪⲥᒥ𐑋ᢵ𝗟,ᥣᛌⳟᅠˉ𝖨ʽʹ𝗖ꮮヿᏝㅡᆡㄷ,ニᒧᑁꮁட𐐑ⵎ𝖨ⲥⲓⳟ𝖢ᱻᆨ𐐕,ⲅǁʼ𐐹ᛧꮁˌ𝖢𐐛𐐽ᱼㄧⳐߴᛧ,𝗜ㄷߴᄀᅟᱻʽᒧˎᒯᒣᅟニᆫᄂ,ǀᕀⳐᱼᙿʻᒲㅡˋᑄᄂᐧᒪᱼᐳ,Ꞌ𝗖ᣟ𝖨𐐕ᐩㆎʹⳐヿᑊ𐐑ᣟ𝖨ᛧ,ニᒧᑁꮁட𐐑ⵎ𝖨ⲥⲓⳟ𝖢ᱻᆨ𐐕,ᱻᑁᒬʹᒣᆞⲷᙿˏᛧᏝ𐑋Ꮭᐳꮮ,ʻⲄ𝝣ᅳᒬˈˌⲓˍᢴ𝝣ᅟⳞⳞᒧ,Ꞌ𝗖ᣟ𝖨𐐕ᐩㆎʹⳐヿᑊ𐐑ᣟ𝖨ᛧ,𝖢ᒪⲺᐸᑀˎᆫ𐑃𐑋ǁʻ𝖫𝗜ヿᑄ,𝗜ㄷߴᄀᅟᱻʽᒧˎᒯᒣᅟニᆫᄂ,ᛌꮮⳐⵏⲄ𝗹ᥣᛧߴㄴⳞʹᙿꮯᣟ,ᥣᛌⳟᅠˉ𝖨ʽʹ𝗖ꮮヿᏝㅡᆡㄷ,ꮮˍᐸᐩᅟˌʻᒬ𝗹டˋㄱｰ𝗝ꓹ,ǀᕀⳐᱼᙿʻᒲㅡˋᑄᄂᐧᒪᱼᐳ,𝗜ㄷߴᄀᅟᱻʽᒧˎᒯᒣᅟニᆫᄂ,ᱻᑁᒬʹᒣᆞⲷᙿˏᛧᏝ𐑋Ꮭᐳꮮ,𐑋ᆞⳟˍᑀᒷⳞʹⳞᕀ𝗟ᄂᛁ𝖢Ꮮ,ᒯㄷᆡᒲᑉᒷᒲㅡꞋˊᆫᒲᄀ𝗟ʹ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,𐑋ᆞⳟˍᑀᒷⳞʹⳞᕀ𝗟ᄂᛁ𝖢Ꮮ,ᱻᑁᒬʹᒣᆞⲷᙿˏᛧᏝ𐑋Ꮭᐳꮮ,ᛌꮮⳐⵏⲄ𝗹ᥣᛧߴㄴⳞʹᙿꮯᣟ,ᐸⵎʼㅡߵⲶᐧᛌ𝗜ᐳᑁᎱㆎⲤ𝗝,Ꮭ𝗅ᑁᅠᅠᐧヿᒯ𝗟ᄂᛌꮯǀˊᐨ,ᅳ𐑃ｰᅳʹᑉꞋㆍⲺᐳⳐˈᱼᒣᒪ,ᏞヿᐳᆡᇺᏝʹˋᄂᇺ𝖩𝝞𐑃Ꮁⲅ,𝗝ⵏᄂˎʹᣟꓹⳐᑄʻꘌᒣⳐ𝗟𝗝,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,Ꞌ𝗖ᣟ𝖨𐐕ᐩㆎʹⳐヿᑊ𐐑ᣟ𝖨ᛧ,ᥣᆫ𐐑Ꞌǀᛁᒥⲥᢴᒪⲥᒥ𐑋ᢵ𝗟,ᥣᛌⳟᅠˉ𝖨ʽʹ𝗖ꮮヿᏝㅡᆡㄷ,ニᒧᑁꮁட𐐑ⵎ𝖨ⲥⲓⳟ𝖢ᱻᆨ𐐕,ⲅǁʼ𐐹ᛧꮁˌ𝖢𐐛𐐽ᱼㄧⳐߴᛧ,𝗜ㄷߴᄀᅟᱻʽᒧˎᒯᒣᅟニᆫᄂ,ǀᕀⳐᱼᙿʻᒲㅡˋᑄᄂᐧᒪᱼᐳ,Ꞌ𝗖ᣟ𝖨𐐕ᐩㆎʹⳐヿᑊ𐐑ᣟ𝖨ᛧ,ʹᑅᄂᣞˉᒧㄴㄱ𝝘டᑁꘌᛌニˍ,ᅳ𐑃ｰᅳʹᑉꞋㆍⲺᐳⳐˈᱼᒣᒪ,ᥣᛌⳟᅠˉ𝖨ʽʹ𝗖ꮮヿᏝㅡᆡㄷ,ʻⲄ𝝣ᅳᒬˈˌⲓˍᢴ𝝣ᅟⳞⳞᒧ,Ꞌ𝗖ᣟ𝖨𐐕ᐩㆎʹⳐヿᑊ𐐑ᣟ𝖨ᛧ,𝖢ᒪⲺᐸᑀˎᆫ𐑃𐑋ǁʻ𝖫𝗜ヿᑄ,𝗜ㄷߴᄀᅟᱻʽᒧˎᒯᒣᅟニᆫᄂ,ᛌꮮⳐⵏⲄ𝗹ᥣᛧߴㄴⳞʹᙿꮯᣟ,ᥣᛌⳟᅠˉ𝖨ʽʹ𝗖ꮮヿᏝㅡᆡㄷ,ꮮˍᐸᐩᅟˌʻᒬ𝗹டˋㄱｰ𝗝ꓹ,ǀᕀⳐᱼᙿʻᒲㅡˋᑄᄂᐧᒪᱼᐳ,𝗜ㄷߴᄀᅟᱻʽᒧˎᒯᒣᅟニᆫᄂ,ᱻᑁᒬʹᒣᆞⲷᙿˏᛧᏝ𐑋Ꮭᐳꮮ,𐑋ᆞⳟˍᑀᒷⳞʹⳞᕀ𝗟ᄂᛁ𝖢Ꮮ,ᒯㄷᆡᒲᑉᒷᒲㅡꞋˊᆫᒲᄀ𝗟ʹ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ꮮˍᐸᐩᅟˌʻᒬ𝗹டˋㄱｰ𝗝ꓹ,ᱻᑁᒬʹᒣᆞⲷᙿˏᛧᏝ𐑋Ꮭᐳꮮ,ᅳ𐑃ｰᅳʹᑉꞋㆍⲺᐳⳐˈᱼᒣᒪ,ᒯᐧ𝖩𐐽ʹᏞㄱᐸᒥˊⲄᐳᒲᅟⲷ,ᐸⵎʼㅡߵⲶᐧᛌ𝗜ᐳᑁᎱㆎⲤ𝗝,𐑋ᆞⳟˍᑀᒷⳞʹⳞᕀ𝗟ᄂᛁ𝖢Ꮮ,ᏞヿᐳᆡᇺᏝʹˋᄂᇺ𝖩𝝞𐑃Ꮁⲅ,𝗝ⵏᄂˎʹᣟꓹⳐᑄʻꘌᒣⳐ𝗟𝗝,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋