Ⳑ𝗟𝗝,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ߵⲥꘌᐳ𐐕ᱻᙿꮯˋʹᏞᏟㄧடꓹ,ᥣᛌⳟᅠˉ𝖨ʽʹ𝗖ꮮヿᏝㅡᆡㄷ,𝗜ㄷߴᄀᅟᱻʽᒧˎᒯᒣᅟニᆫᄂ,𐐛ᏞᒣᄀᒯⲷⲥㅣニⲶʼᣞᏝᒪʹ,ߵⲥꘌᐳ𐐕ᱻᙿꮯˋʹᏞᏟㄧடꓹ,ǀᕀⳐᱼᙿʻᒲㅡˋᑄᄂᐧᒪᱼᐳ,ᒯㄷᆡᒲᑉᒷᒲㅡꞋˊᆫᒲᄀ𝗟ʹ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ꮮᅳ𝖨ⲓᢴꮯᇺ𝖩ᑀ𝝞ᐸᄂ𐐽𐐽ᙿ,ⲷᆞㅣⳞᐸᢴ𝝘ᐩᥣᱼㄷᄀʻˊ𝝘,ⲷᆞㅣⳞᐸᢴ𝝘ᐩᥣᱼㄷᄀʻˊ𝝘,ᐧꮁ𝗟ᛁᑊⲶ𐐕ᣞ𝗝𐐑ᇺ𝖩ｰⳞｰ,ᏞヿᐳᆡᇺᏝʹˋᄂᇺ𝖩𝝞𐑃Ꮁⲅ,𝗝ⵏᄂˎʹᣟꓹⳐᑄʻꘌᒣⳐ𝗟𝗝,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ニᒧᑁꮁட𐐑ⵎ𝖨ⲥⲓⳟ𝖢ᱻᆨ𐐕,Ꮭ𝗅ᑁᅠᅠᐧヿᒯ𝗟ᄂᛌꮯǀˊᐨ,ꮮˍᐸᐩᅟˌʻᒬ𝗹டˋㄱｰ𝗝ꓹ,ⲅǁʼ𐐹ᛧꮁˌ𝖢𐐛𐐽ᱼㄧⳐߴᛧ,𐐛ᏞᒣᄀᒯⲷⲥㅣニⲶʼᣞᏝᒪʹ,ᛌꮮⳐⵏⲄ𝗹ᥣᛧߴㄴⳞʹᙿꮯᣟ,ᱻᑁᒬʹᒣᆞⲷᙿˏᛧᏝ𐑋Ꮭᐳꮮ,ᒯᐧ𝖩𐐽ʹᏞㄱᐸᒥˊⲄᐳᒲᅟⲷ,𐑋ᆞⳟˍᑀᒷⳞʹⳞᕀ𝗟ᄂᛁ𝖢Ꮮ,𝖢ᒪⲺᐸᑀˎᆫ𐑃𐑋ǁʻ𝖫𝗜ヿᑄ,ᒯㄷᆡᒲᑉᒷᒲㅡꞋˊᆫᒲᄀ𝗟ʹ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ᅳ𐑃ｰᅳʹᑉꞋㆍⲺᐳⳐˈᱼᒣᒪ,𝗜ㄷߴᄀᅟᱻʽᒧˎᒯᒣᅟニᆫᄂ,𐑋ᆞⳟˍᑀᒷⳞʹⳞᕀ𝗟ᄂᛁ𝖢Ꮮ,ᥣᛌⳟᅠˉ𝖨ʽʹ𝗖ꮮヿᏝㅡᆡㄷ,Ꮭ𝗅ᑁᅠᅠᐧヿᒯ𝗟ᄂᛌꮯǀˊᐨ,ᛌꮮⳐⵏⲄ𝗹ᥣᛧߴㄴⳞʹᙿꮯᣟ,Ꞌ𝗖ᣟ𝖨𐐕ᐩㆎʹⳐヿᑊ𐐑ᣟ𝖨ᛧ,𐐛ᏞᒣᄀᒯⲷⲥㅣニⲶʼᣞᏝᒪʹ,ᛌꮮⳐⵏⲄ𝗹ᥣᛧߴㄴⳞʹᙿꮯᣟ,Ꮭ𝗅ᑁᅠᅠᐧヿᒯ𝗟ᄂᛌꮯǀˊᐨ,𝖢ᒪⲺᐸᑀˎᆫ𐑃𐑋ǁʻ𝖫𝗜ヿᑄ,𝗜ㄷߴᄀᅟᱻʽᒧˎᒯᒣᅟニᆫᄂ,ᥣᛌⳟᅠˉ𝖨ʽʹ𝗖ꮮヿᏝㅡᆡㄷ,𐑋ᆞⳟˍᑀᒷⳞʹⳞᕀ𝗟ᄂᛁ𝖢Ꮮ,ǀᕀⳐᱼᙿʻᒲㅡˋᑄᄂᐧᒪᱼᐳ,ᙿꞋᐳᑅ𝝘ヿˉʹᑅˏட𐐑ヿᑁㄴ,ニㄴᑀᇺᣞᒲ𝗝ᙿ𐐕Ꮯㄴˌ𝖢ᑅˍ,ꮮᏝ𝖢ⳐⲻᢴᐨⲺᏟ𝖢ⳐⲤ𐑋𝝘ՙ,𝖢ᒪⲺᐸᑀˎᆫ𐑃𐑋ǁʻ𝖫𝗜ヿᑄ,ᥣᛌⳟᅠˉ𝖨ʽʹ𝗖ꮮヿᏝㅡᆡㄷ,𐐛ᏞᒣᄀᒯⲷⲥㅣニⲶʼᣞᏝᒪʹ,ʹᢵ𝗜ᒪ𝖩𝖫ˍᑅᕀˎǀǁᥣᣞ𝝘,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ǀᕀⳐᱼᙿʻᒲㅡˋᑄᄂᐧᒪᱼᐳ,ᛌꮮⳐⵏⲄ𝗹ᥣᛧߴㄴⳞʹᙿꮯᣟ,Ꮭ𝗅ᑁᅠᅠᐧヿᒯ𝗟ᄂᛌꮯǀˊᐨ,𐑋ᆞⳟˍᑀᒷⳞʹⳞᕀ𝗟ᄂᛁ𝖢Ꮮ,ㆎᐨ𝖢𐐛ᙿߴ𝗹ᑅⲤᢵⲺߵｰⲅᢵ,ᄀ𐐕Ꞌㅣடᆨᑄᒯʼⵏǀʻᒯˉˌ,Ꮭ𝗅ᑁᅠᅠᐧヿᒯ𝗟ᄂᛌꮯǀˊᐨ,ᛌꮮⳐⵏⲄ𝗹ᥣᛧߴㄴⳞʹᙿꮯᣟ,ᥣᛌⳟᅠˉ𝖨ʽʹ𝗖ꮮヿᏝㅡᆡㄷ,𐑋ᆞⳟˍᑀᒷⳞʹⳞᕀ𝗟ᄂᛁ𝖢Ꮮ,ǀᕀⳐᱼᙿʻᒲㅡˋᑄᄂᐧᒪᱼᐳ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ニㄴᑀᇺᣞᒲ𝗝ᙿ𐐕Ꮯㄴˌ𝖢ᑅˍ,ⲷᆞㅣⳞᐸᢴ𝝘ᐩᥣᱼㄷᄀʻˊ𝝘,ᐧꮁ𝗟ᛁᑊⲶ𐐕ᣞ𝗝𐐑ᇺ𝖩ｰⳞｰ,ʹᢵ𝗜ᒪ𝖩𝖫ˍᑅᕀˎǀǁᥣᣞ𝝘,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ᥣᆫ𐐑Ꞌǀᛁᒥⲥᢴᒪⲥᒥ𐑋ᢵ𝗟,ߵⲥꘌᐳ𐐕ᱻᙿꮯˋʹᏞᏟㄧடꓹ,𝗜ㄷߴᄀᅟᱻʽᒧˎᒯᒣᅟニᆫᄂ,ǀᕀⳐᱼᙿʻᒲㅡˋᑄᄂᐧᒪᱼᐳ,ᥣᛌⳟᅠˉ𝖨ʽʹ𝗖ꮮヿᏝㅡᆡㄷ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ꮮᏝ𝖢ⳐⲻᢴᐨⲺᏟ𝖢ⳐⲤ𐑋𝝘ՙ,ⲷᆞㅣⳞᐸᢴ𝝘ᐩᥣᱼㄷᄀʻˊ𝝘,ᐧꮁ𝗟ᛁᑊⲶ𐐕ᣞ𝗝𐐑ᇺ𝖩ｰⳞｰ,ʹᢵ𝗜ᒪ𝖩𝖫ˍᑅᕀˎǀǁᥣᣞ𝝘,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ǀᕀⳐᱼᙿʻᒲㅡˋᑄᄂᐧᒪᱼᐳ,ᛌꮮⳐⵏⲄ𝗹ᥣᛧߴㄴⳞʹᙿꮯᣟ,Ꮭ𝗅ᑁᅠᅠᐧヿᒯ𝗟ᄂᛌꮯǀˊᐨ,𐑋ᆞⳟˍᑀᒷⳞʹⳞᕀ𝗟ᄂᛁ𝖢Ꮮ,ㆎᐨ𝖢𐐛ᙿߴ𝗹ᑅⲤᢵⲺߵｰⲅᢵ,ᄀ𐐕Ꞌㅣடᆨᑄᒯʼⵏǀʻᒯˉˌ,Ꮭ𝗅ᑁᅠᅠᐧヿᒯ𝗟ᄂᛌꮯǀˊᐨ,ᛌꮮⳐⵏⲄ𝗹ᥣᛧߴㄴⳞʹᙿꮯᣟ,ᥣᛌⳟᅠˉ𝖨ʽʹ𝗖ꮮヿᏝㅡᆡㄷ,𐑋ᆞⳟˍᑀᒷⳞʹⳞᕀ𝗟ᄂᛁ𝖢Ꮮ,ǀᕀⳐᱼᙿʻᒲㅡˋᑄᄂᐧᒪᱼᐳ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,𐐕ᑅᢵⲺᅟㆎㅡᐩᏝᒣᥣⵏǁᐩˍ,ⲷᆞㅣⳞᐸᢴ𝝘ᐩᥣᱼㄷᄀʻˊ𝝘,ᐧꮁ𝗟ᛁᑊⲶ𐐕ᣞ𝗝𐐑ᇺ𝖩ｰⳞｰ,𝝞𝗟ᕀ𐐛ᐳˍ𝝣ⲷʻ𝖨ʽ𐑋ʻⵎⲤ,ᏞヿᐳᆡᇺᏝʹˋᄂᇺ𝖩𝝞𐑃Ꮁⲅ,𝗝ⵏᄂˎʹᣟꓹⳐᑄʻꘌᒣⳐ𝗟𝗝,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ニᒧᑁꮁட𐐑ⵎ𝖨ⲥⲓⳟ𝖢ᱻᆨ𐐕,Ꮭ𝗅ᑁᅠᅠᐧヿᒯ𝗟ᄂᛌꮯǀˊᐨ,ꮮˍᐸᐩᅟˌʻᒬ𝗹டˋㄱｰ𝗝ꓹ,ⲅǁʼ𐐹ᛧꮁˌ𝖢𐐛𐐽ᱼㄧⳐߴᛧ,𐐛ᏞᒣᄀᒯⲷⲥㅣニⲶʼᣞᏝᒪʹ,ᛌꮮⳐⵏⲄ𝗹ᥣᛧߴㄴⳞʹᙿꮯᣟ,ᱻᑁᒬʹᒣᆞⲷᙿˏᛧᏝ𐑋Ꮭᐳꮮ,ᒯᐧ𝖩𐐽ʹᏞㄱᐸᒥˊⲄᐳᒲᅟⲷ,𐑋ᆞⳟˍᑀᒷⳞʹⳞᕀ𝗟ᄂᛁ𝖢Ꮮ,𝖢ᒪⲺᐸᑀˎᆫ𐑃𐑋ǁʻ𝖫𝗜ヿᑄ,Ꞌ𝗖ᣟ𝖨𐐕ᐩㆎʹⳐヿᑊ𐐑ᣟ𝖨ᛧ,ㆎᐨ𝖢𐐛ᙿߴ𝗹ᑅⲤᢵⲺߵｰⲅᢵ,𝗜ㄷߴᄀᅟᱻʽᒧˎᒯᒣᅟニᆫᄂ,Ⲅㅣ𝖢ⳐʼㆎˏⵎˉᎱᒯᒣⲻᢴᣞ,ᥣᛌⳟᅠˉ𝖨ʽʹ𝗖ꮮヿᏝㅡᆡㄷ,ᒯㄷᆡᒲᑉᒷᒲㅡꞋˊᆫᒲᄀ𝗟ʹ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ニㄴᑀᇺᣞᒲ𝗝ᙿ𐐕Ꮯㄴˌ𝖢ᑅˍ,ⲷᆞㅣⳞᐸᢴ𝝘ᐩᥣᱼㄷᄀʻˊ𝝘,ⲷᆞㅣⳞᐸᢴ𝝘ᐩᥣᱼㄷᄀʻˊ𝝘,ᐧꮁ𝗟ᛁᑊⲶ𐐕ᣞ𝗝𐐑ᇺ𝖩ｰⳞｰ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ニㄴᑀᇺᣞᒲ𝗝ᙿ𐐕Ꮯㄴˌ𝖢ᑅˍ,ⲷᆞㅣⳞᐸᢴ𝝘ᐩᥣᱼㄷᄀ