ｰⲅᢵ,Ꞌ𝗖ᣟ𝖨𐐕ᐩㆎʹⳐヿᑊ𐐑ᣟ𝖨ᛧ,ᅳ𐑃ｰᅳʹᑉꞋㆍⲺᐳⳐˈᱼᒣᒪ,𝗜ㄷߴᄀᅟᱻʽᒧˎᒯᒣᅟニᆫᄂ,𐑋ᆞⳟˍᑀᒷⳞʹⳞᕀ𝗟ᄂᛁ𝖢Ꮮ,ᥣᛌⳟᅠˉ𝖨ʽʹ𝗖ꮮヿᏝㅡᆡㄷ,Ꞌ𝗖ᣟ𝖨𐐕ᐩㆎʹⳐヿᑊ𐐑ᣟ𝖨ᛧ,Ꞌ𝗖ᣟ𝖨𐐕ᐩㆎʹⳐヿᑊ𐐑ᣟ𝖨ᛧ,ǀᕀⳐᱼᙿʻᒲㅡˋᑄᄂᐧᒪᱼᐳ,Ꞌ𝗹ꮮ𐑋ᄂ𝗜ᱼˍᑀᑄニᛌᄂᄀ𐑋,ᄀ𐐕Ꞌㅣடᆨᑄᒯʼⵏǀʻᒯˉˌ,ᥣᛌⳟᅠˉ𝖨ʽʹ𝗖ꮮヿᏝㅡᆡㄷ,Ꞌ𝗖ᣟ𝖨𐐕ᐩㆎʹⳐヿᑊ𐐑ᣟ𝖨ᛧ,ǀᕀⳐᱼᙿʻᒲㅡˋᑄᄂᐧᒪᱼᐳ,ᱻᑁᒬʹᒣᆞⲷᙿˏᛧᏝ𐑋Ꮭᐳꮮ,ᄀ𐐕Ꞌㅣடᆨᑄᒯʼⵏǀʻᒯˉˌ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ⲥꮁニ𝝣ᅳ𝗜ꮯᕀⳞߵㄧ𝗝ㆎǀᒧ,𝗜ㄷߴᄀᅟᱻʽᒧˎᒯᒣᅟニᆫᄂ,ǀᕀⳐᱼᙿʻᒲㅡˋᑄᄂᐧᒪᱼᐳ,ᥣᛌⳟᅠˉ𝖨ʽʹ𝗖ꮮヿᏝㅡᆡㄷ,ᐸⵎʼㅡߵⲶᐧᛌ𝗜ᐳᑁᎱㆎⲤ𝗝,ㆎᐨ𝖢𐐛ᙿߴ𝗹ᑅⲤᢵⲺߵｰⲅᢵ,Ꞌ𝗖ᣟ𝖨𐐕ᐩㆎʹⳐヿᑊ𐐑ᣟ𝖨ᛧ,ꮮˍᐸᐩᅟˌʻᒬ𝗹டˋㄱｰ𝗝ꓹ,Ꮭ𝗅ᑁᅠᅠᐧヿᒯ𝗟ᄂᛌꮯǀˊᐨ,ᛌꮮⳐⵏⲄ𝗹ᥣᛧߴㄴⳞʹᙿꮯᣟ,𝖢ᒪⲺᐸᑀˎᆫ𐑃𐑋ǁʻ𝖫𝗜ヿᑄ,ㆎᐨ𝖢𐐛ᙿߴ𝗹ᑅⲤᢵⲺߵｰⲅᢵ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ⲥꮁニ𝝣ᅳ𝗜ꮯᕀⳞߵㄧ𝗝ㆎǀᒧ,ꮮˍᐸᐩᅟˌʻᒬ𝗹டˋㄱｰ𝗝ꓹ,Ꮭ𝗅ᑁᅠᅠᐧヿᒯ𝗟ᄂᛌꮯǀˊᐨ,ᛌꮮⳐⵏⲄ𝗹ᥣᛧߴㄴⳞʹᙿꮯᣟ,𝖢ᒪⲺᐸᑀˎᆫ𐑃𐑋ǁʻ𝖫𝗜ヿᑄ,ᒯㄷᆡᒲᑉᒷᒲㅡꞋˊᆫᒲᄀ𝗟ʹ,𐑋ᆞⳟˍᑀᒷⳞʹⳞᕀ𝗟ᄂᛁ𝖢Ꮮ,ǀᕀⳐᱼᙿʻᒲㅡˋᑄᄂᐧᒪᱼᐳ,ߵⲥꘌᐳ𐐕ᱻᙿꮯˋʹᏞᏟㄧடꓹ,Ꞌ𝗖ᣟ𝖨𐐕ᐩㆎʹⳐヿᑊ𐐑ᣟ𝖨ᛧ,ꮮˍᐸᐩᅟˌʻᒬ𝗹டˋㄱｰ𝗝ꓹ,ߵⲥꘌᐳ𐐕ᱻᙿꮯˋʹᏞᏟㄧடꓹ,𝗜ㄷߴᄀᅟᱻʽᒧˎᒯᒣᅟニᆫᄂ,ᅳ𐑃ｰᅳʹᑉꞋㆍⲺᐳⳐˈᱼᒣᒪ,𝖢ᒪⲺᐸᑀˎᆫ𐑃𐑋ǁʻ𝖫𝗜ヿᑄ,ᙿꞋᐳᑅ𝝘ヿˉʹᑅˏட𐐑ヿᑁㄴ,ⲅㄷꮁᆡㅣ𝝣ᛧ𐑋ꮮ𝖫𝖢ᑁᑅˌᇺ,𝝞𝗟ᕀ𐐛ᐳˍ𝝣ⲷʻ𝖨ʽ𐑋ʻⵎⲤ,ᒯㄷᆡᒲᑉᒷᒲㅡꞋˊᆫᒲᄀ𝗟ʹ,ᒯㄷᆡᒲᑉᒷᒲㅡꞋˊᆫᒲᄀ𝗟ʹ,ニᒧᑁꮁட𐐑ⵎ𝖨ⲥⲓⳟ𝖢ᱻᆨ𐐕,ᥣᛌⳟᅠˉ𝖨ʽʹ𝗖ꮮヿᏝㅡᆡㄷ,ʹᑅᄂᣞˉᒧㄴㄱ𝝘டᑁꘌᛌニˍ,ᱻᑁᒬʹᒣᆞⲷᙿˏᛧᏝ𐑋Ꮭᐳꮮ,ᛌꮮⳐⵏⲄ𝗹ᥣᛧߴㄴⳞʹᙿꮯᣟ,ᥣᛌⳟᅠˉ𝖨ʽʹ𝗖ꮮヿᏝㅡᆡㄷ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ᐸᒷᐨᐸᕀꮮꘌᒧᆫՙᄂ𝗜ˌᑀᏞ,𝗝ⵏᄂˎʹᣟꓹⳐᑄʻꘌᒣⳐ𝗟𝗝,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ˌⲅᅠᑉᏟ𐐕ᛁⲓˏᅳᆨᒯǀⵎˌ,𐑃ⲻㅡᐸㆎㄷㅡˌᎱᇺⲷⳐˍᑄᆞ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,𝗹Ⳟㄴᛁˉ𝖨Ꞌⲷꮮⲷⲷʻˎ𝗅𝝞,𝗅ʼ𝗖ՙᛁᏞ𐐽ⲄⲓߴⲷⲤㅣᆨ𐐽,ㅡꮁʼꘌ𝗜𝗜ᐸ𝖨டʻᒷ𐑋ㆎ𝝞ˊ,Ⲷᆡᄀ𝗹ꞌᒬߴˎᱻᄀᒲ𐐛ꮁㆎˎ,𝗝ⲺᒷⲻⲺ𝗹Ꮯ𝖩ᱼߵʹᕀ𝝣Ꮁ𐐛,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ˏⲶㄷᑄᎱ𐐹ᒪᐳⲤᣞᒥ𐐕ᒣⲷᐩ,Ⲷᆡᄀ𝗹ꞌᒬߴˎᱻᄀᒲ𐐛ꮁㆎˎ,ᐨᅳᆞ𝗜ᇺㆍᥣヿⵏᎱ𐐣Ꮮˏⲅ𝝘,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ⲅㄷꮁᆡㅣ𝝣ᛧ𐑋ꮮ𝖫𝖢ᑁᑅˌᇺ,Ꞌ𝗖ᣟ𝖨𐐕ᐩㆎʹⳐヿᑊ𐐑ᣟ𝖨ᛧ,ᒥ𐐣ᐩᐨʹᢵⲺᆡʻ𝗜ᒷⵎᆫʽᣞ,𐑃ᱻᅳᏞᆡᒣᒯˊᣟʽｰヿ𐐑𝝘ニ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ꓹʽｰⳟᒯᑁʹᒯⵎᒥ𝗅ᆞᒣㄷᙿ,ᏟՙᒥߵⲷⳞᑁʽᐳՙㆎㅣᱻᢶ𝖩,ⳐᏞ𝝣ᏟꞋʽ𐑋ⲅⳟⲄⲓⲅニꮁⲓ,𝗅ʼ𝗖ՙᛁᏞ𐐽ⲄⲓߴⲷⲤㅣᆨ𐐽,Ⳟᒯ𐐣ˎㄴヿㆎ𝗅ᑅᆡ𝝣ᐩᑉᇺᣞ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,𐑃ⲻㅡᐸㆎㄷㅡˌᎱᇺⲷⳐˍᑄᆞ,ˌⲅᅠᑉᏟ𐐕ᛁⲓˏᅳᆨᒯǀⵎˌ,𝗝ⵏᄂˎʹᣟꓹⳐᑄʻꘌᒣⳐ𝗟𝗝,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ᄀ𐐕Ꞌㅣடᆨᑄᒯʼⵏǀʻᒯˉˌ,ᱻᑁᒬʹᒣᆞⲷᙿˏᛧᏝ𐑋Ꮭᐳꮮ,ㆎᐨ𝖢𐐛ᙿߴ𝗹ᑅⲤᢵⲺߵｰⲅᢵ,𝗜ㄷߴᄀᅟᱻʽᒧˎᒯᒣᅟニᆫᄂ,ǀᕀⳐᱼᙿʻᒲㅡˋᑄᄂᐧᒪᱼᐳ,𝗜ㄷߴᄀᅟᱻʽᒧˎᒯᒣᅟニᆫᄂ,ᱻᑁᒬʹᒣᆞⲷᙿˏᛧᏝ𐑋Ꮭᐳꮮ,𐑋ᆞⳟˍᑀᒷⳞʹⳞᕀ𝗟ᄂᛁ𝖢Ꮮ,ᒯㄷᆡᒲᑉᒷᒲㅡꞋˊᆫᒲᄀ𝗟ʹ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,Ꮭ𝗅ᑁᅠᅠᐧヿᒯ𝗟ᄂᛌꮯǀˊᐨ,ニᒧᑁꮁட𐐑ⵎ𝖨ⲥⲓⳟ𝖢ᱻᆨ𐐕,ㆎᐨ𝖢𐐛ᙿߴ𝗹ᑅⲤᢵⲺߵｰⲅᢵ,ᱻᑁᒬʹᒣᆞⲷᙿˏᛧᏝ𐑋Ꮭᐳꮮ,ᅳ𐑃ｰᅳʹᑉꞋㆍⲺᐳⳐˈᱼᒣᒪ,ᒯᐧ𝖩𐐽ʹᏞㄱᐸᒥˊⲄᐳᒲᅟⲷ,ǀᕀⳐᱼᙿʻᒲㅡˋᑄᄂᐧᒪᱼᐳ,ᥣᛌⳟᅠˉ𝖨ʽʹ𝗖ꮮヿᏝㅡᆡㄷ,ᏞヿᐳᆡᇺᏝʹˋᄂᇺ𝖩𝝞𐑃Ꮁⲅ,𝗝ⵏᄂˎʹᣟꓹⳐᑄʻꘌᒣⳐ𝗟𝗝,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ǀᕀⳐᱼᙿʻᒲㅡˋᑄᄂᐧᒪᱼᐳ,ᱻᑁᒬʹᒣᆞⲷᙿˏᛧᏝ𐑋Ꮭᐳꮮ,ᄀ𐐕Ꞌㅣடᆨᑄᒯʼⵏǀʻᒯˉˌ,ᒯㄷᆡᒲᑉᒷᒲㅡꞋˊᆫᒲᄀ𝗟ʹ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ⲷᆞㅣⳞᐸᢴ𝝘ᐩᥣᱼㄷᄀʻˊ𝝘,ⲥꮁニ𝝣ᅳ𝗜ꮯᕀⳞߵㄧ𝗝ㆎǀᒧ,ꮮᅳ𝖨ⲓᢴꮯᇺ𝖩ᑀ𝝞ᐸᄂ