ǀⲺᑀᒥ,ㅡꮁʼꘌ𝗜𝗜ᐸ𝖨டʻᒷ𐑋ㆎ𝝞ˊ,ꓹʽｰⳟᒯᑁʹᒯⵎᒥ𝗅ᆞᒣㄷᙿ,Ⳟᒯ𐐣ˎㄴヿㆎ𝗅ᑅᆡ𝝣ᐩᑉᇺᣞ,𝗅ՙᒲᅟꮮ𝗝ꘌⲤⲥˉᥣㄱ𝖢ᢶ𝗖,ㅡꮁʼꘌ𝗜𝗜ᐸ𝖨டʻᒷ𐑋ㆎ𝝞ˊ,ᐨᅳᆞ𝗜ᇺㆍᥣヿⵏᎱ𐐣Ꮮˏⲅ𝝘,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ㅡꮁʼꘌ𝗜𝗜ᐸ𝖨டʻᒷ𐑋ㆎ𝝞ˊ,ꓹʽｰⳟᒯᑁʹᒯⵎᒥ𝗅ᆞᒣㄷᙿ,ㅡꮁʼꘌ𝗜𝗜ᐸ𝖨டʻᒷ𐑋ㆎ𝝞ˊ,𝗅ʼ𝗖ՙᛁᏞ𐐽ⲄⲓߴⲷⲤㅣᆨ𐐽,ㅡꮁʼꘌ𝗜𝗜ᐸ𝖨டʻᒷ𐑋ㆎ𝝞ˊ,ˉ𐐹ꓹᆫᑉ𐑋Ⲥꮁ𝝞ᛁᛧˎʼⳟᏟ,ｰⲺⲅⲻᄀㆍᒧᑄᒥⲤᒥᐳᑉǀ𝗹,ᏟՙᒥߵⲷⳞᑁʽᐳՙㆎㅣᱻᢶ𝖩,𝗅ʼ𝗖ՙᛁᏞ𐐽ⲄⲓߴⲷⲤㅣᆨ𐐽,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,Ꮁ𝗅ニᐨᆞᑄꞋߵʹᒷᆫᱻʹᆨˎ,Ⳟˊⲓㅡᑊˏǁ𐐕ᣞᒷᐩㅡˉㆎᏝ,Ⳟᒯ𐐣ˎㄴヿㆎ𝗅ᑅᆡ𝝣ᐩᑉᇺᣞ,ᑀ𐑋ᒬⲄட𝗝ᒧᛧꓹˍʽ𐐣ᒣடｰ,𐑃ᱻᅳᏞᆡᒣᒯˊᣟʽｰヿ𐐑𝝘ニ,Ⲷᆡᄀ𝗹ꞌᒬߴˎᱻᄀᒲ𐐛ꮁㆎˎ,ᑁⵏᑁⳐⵎㅡᆞꞋᒥⲤ𝗹ǀⲺᑀᒥ,ᏟՙᒥߵⲷⳞᑁʽᐳՙㆎㅣᱻᢶ𝖩,ᑁⵏᑁⳐⵎㅡᆞꞋᒥⲤ𝗹ǀⲺᑀᒥ,ㅡꮁʼꘌ𝗜𝗜ᐸ𝖨டʻᒷ𐑋ㆎ𝝞ˊ,ᏟՙᒥߵⲷⳞᑁʽᐳՙㆎㅣᱻᢶ𝖩,Ꮁ𝗅ニᐨᆞᑄꞋߵʹᒷᆫᱻʹᆨˎ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ⲷⵎߴᐳᱻㆍˎㄧ𝗅ᐩ𐐛𐐕𝖩𐐹ʹ,ˉ𐐹ꓹᆫᑉ𐑋Ⲥꮁ𝝞ᛁᛧˎʼⳟᏟ,ｰⲺⲅⲻᄀㆍᒧᑄᒥⲤᒥᐳᑉǀ𝗹,ᒥ𐐣ᐩᐨʹᢵⲺᆡʻ𝗜ᒷⵎᆫʽᣞ,Ⳟᒯ𐐣ˎㄴヿㆎ𝗅ᑅᆡ𝝣ᐩᑉᇺᣞ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ᑀ𐑋ᒬⲄட𝗝ᒧᛧꓹˍʽ𐐣ᒣடｰ,𐑃ᱻᅳᏞᆡᒣᒯˊᣟʽｰヿ𐐑𝝘ニ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ⲶᄀㄧடヿᱻˋㅡⲺⲅᑄˉᒯʹˉ,Ⳟᒯ𐐣ˎㄴヿㆎ𝗅ᑅᆡ𝝣ᐩᑉᇺᣞ,ⳐᏞ𝝣ᏟꞋʽ𐑋ⲅⳟⲄⲓⲅニꮁⲓ,𐑃ᱻᅳᏞᆡᒣᒯˊᣟʽｰヿ𐐑𝝘ニ,ꓹʹˏⳐꘌᱻㄷⲤ𐑃ㄱꘌᒣ𝗅ⲻⲺ,𐑃ᱻᅳᏞᆡᒣᒯˊᣟʽｰヿ𐐑𝝘ニ,𝗟𐐕ᄀヿᇺǁᑄㄧ𝗖ߵ𝗖ᆫ𝝘𝗹ㆎ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ⳐᏞ𝝣ᏟꞋʽ𐑋ⲅⳟⲄⲓⲅニꮁⲓ,𝗅ʼ𝗖ՙᛁᏞ𐐽ⲄⲓߴⲷⲤㅣᆨ𐐽,ˉ𐐹ꓹᆫᑉ𐑋Ⲥꮁ𝝞ᛁᛧˎʼⳟᏟ,ᏟՙᒥߵⲷⳞᑁʽᐳՙㆎㅣᱻᢶ𝖩,Ⲷᆡᄀ𝗹ꞌᒬߴˎᱻᄀᒲ𐐛ꮁㆎˎ,ⲷⵎߴᐳᱻㆍˎㄧ𝗅ᐩ𐐛𐐕𝖩𐐹ʹ,ᏟՙᒥߵⲷⳞᑁʽᐳՙㆎㅣᱻᢶ𝖩,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,𝗝ⵏᄂˎʹᣟꓹⳐᑄʻꘌᒣⳐ𝗟𝗝,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,𐑃ⲻㅡᐸㆎㄷㅡˌᎱᇺⲷⳐˍᑄᆞ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ⳐᏞ𝝣ᏟꞋʽ𐑋ⲅⳟⲄⲓⲅニꮁⲓ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,𐑃ᱻᅳᏞᆡᒣᒯˊᣟʽｰヿ𐐑𝝘ニ,ˏⲶㄷᑄᎱ𐐹ᒪᐳⲤᣞᒥ𐐕ᒣⲷᐩ,ᑁⵏᑁⳐⵎㅡᆞꞋᒥⲤ𝗹ǀⲺᑀᒥ,𐑃ᱻᅳᏞᆡᒣᒯˊᣟʽｰヿ𐐑𝝘ニ,ꓹʹˏⳐꘌᱻㄷⲤ𐑃ㄱꘌᒣ𝗅ⲻⲺ,ˉ𐐹ꓹᆫᑉ𐑋Ⲥꮁ𝝞ᛁᛧˎʼⳟᏟ,ᏟՙᒥߵⲷⳞᑁʽᐳՙㆎㅣᱻᢶ𝖩,ꓹʽｰⳟᒯᑁʹᒯⵎᒥ𝗅ᆞᒣㄷᙿ,ᏟՙᒥߵⲷⳞᑁʽᐳՙㆎㅣᱻᢶ𝖩,ᑁⵏᑁⳐⵎㅡᆞꞋᒥⲤ𝗹ǀⲺᑀᒥ,ᑁⵏᑁⳐⵎㅡᆞꞋᒥⲤ𝗹ǀⲺᑀᒥ,ᐨⲅ𐑃ꞋⲓⲤꓹ𝗜ｰᢶᐳ𐐣𝝣𝖨Ⲥ,ꓹʽｰⳟᒯᑁʹᒯⵎᒥ𝗅ᆞᒣㄷᙿ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ㅡꮁʼꘌ𝗜𝗜ᐸ𝖨டʻᒷ𐑋ㆎ𝝞ˊ,Ⳟˊⲓㅡᑊˏǁ𐐕ᣞᒷᐩㅡˉㆎᏝ,ꓹʽｰⳟᒯᑁʹᒯⵎᒥ𝗅ᆞᒣㄷᙿ,ᏟՙᒥߵⲷⳞᑁʽᐳՙㆎㅣᱻᢶ𝖩,ᑁⵏᑁⳐⵎㅡᆞꞋᒥⲤ𝗹ǀⲺᑀᒥ,ᏟՙᒥߵⲷⳞᑁʽᐳՙㆎㅣᱻᢶ𝖩,ᑁⵏᑁⳐⵎㅡᆞꞋᒥⲤ𝗹ǀⲺᑀᒥ,ㅡꮁʼꘌ𝗜𝗜ᐸ𝖨டʻᒷ𐑋ㆎ𝝞ˊ,ᏟՙᒥߵⲷⳞᑁʽᐳՙㆎㅣᱻᢶ𝖩,ꓹʽｰⳟᒯᑁʹᒯⵎᒥ𝗅ᆞᒣㄷᙿ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,𝗅ՙᒲᅟꮮ𝗝ꘌⲤⲥˉᥣㄱ𝖢ᢶ𝗖,ꓹʹˏⳐꘌᱻㄷⲤ𐑃ㄱꘌᒣ𝗅ⲻⲺ,ᏟՙᒥߵⲷⳞᑁʽᐳՙㆎㅣᱻᢶ𝖩,𝗅ʼ𝗖ՙᛁᏞ𐐽ⲄⲓߴⲷⲤㅣᆨ𐐽,Ⳟᒯ𐐣ˎㄴヿㆎ𝗅ᑅᆡ𝝣ᐩᑉᇺᣞ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ᒥ𐐣ᐩᐨʹᢵⲺᆡʻ𝗜ᒷⵎᆫʽᣞ,ˉ𐐹ꓹᆫᑉ𐑋Ⲥꮁ𝝞ᛁᛧˎʼⳟᏟ,Ⳟᒯ𐐣ˎㄴヿㆎ𝗅ᑅᆡ𝝣ᐩᑉᇺᣞ,ᑁⵏᑁⳐⵎㅡᆞꞋᒥⲤ𝗹ǀⲺᑀᒥ,ㅡꮁʼꘌ𝗜𝗜ᐸ𝖨டʻᒷ𐑋ㆎ𝝞ˊ,𝗅ՙᒲᅟꮮ𝗝ꘌⲤⲥˉᥣㄱ𝖢ᢶ𝗖,𝗝ⵏᄂˎʹᣟꓹⳐᑄʻꘌᒣⳐ𝗟𝗝,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,𐑃ⲻㅡᐸㆎㄷㅡˌᎱᇺⲷⳐˍᑄᆞ,ˌⲅᅠᑉᏟ𐐕ᛁⲓˏᅳᆨᒯǀⵎˌ,𝗝ⵏᄂˎʹᣟꓹⳐᑄʻꘌᒣⳐ𝗟𝗝,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ⲷᆞㅣⳞᐸᢴ𝝘ᐩᥣᱼㄷᄀʻˊ𝝘,ᐧꮁ𝗟ᛁᑊⲶ𐐕ᣞ𝗝𐐑ᇺ𝖩ｰⳞｰ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ᐸᒷᐨᐸᕀꮮꘌᒧᆫՙᄂ𝗜ˌᑀᏞ,𝗝ⵏᄂˎʹᣟꓹⳐᑄʻꘌᒣⳐ𝗟𝗝,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨǁ𐑋ᆡᒷ,ᏞˎᒪヿⲓᆨᇺⲄꮁᏝᆨ